INSERT INTO `tl_beachcup_venue` VALUES (3,1457016646,'÷Í—Q¡–å',39030,12.024752,46.768522,'Olang','Valdaora','','','Sportzone','Via Sportzone','Olang','Valdaora'),(6,1457199914,NULL,2345,11.348244,46.493796,'Bozen','sadf','','','asdf','asdf','asdf','sadf'),(7,1461916319,'xP杦\0>\0e',39019,11.160108,46.68585,'Tennis/Beach-Volley Dorf Tirol','Impianti tennis/beach-volley Tirolo','','','Ecke Hauptstraße - Ruprechtsweg','Incrocio tra via Principale e via Ruprecht','Dorf Tirol','Tirolo'),(8,1461916825,'ݺ\rR杦\0>\0e',39043,11.57601,46.644968,'Freibad Klausen','Piscina scoperta Chiusa','','','Sportzone Klausen','Zona sportiva Chiusa','Klausen','Chiusa'),(9,1463418166,'@PS杦\0>\0e',39030,11.942462,46.566633,'San Ciascian - Alta Badia','San Ciascian - Alta Badia','<p>Die Beachvolleyballanlage in San Ciascian (Gemeinde Abtei) ist eine der höstgelegenen in Südtirol. Gebaggert und gepritscht wird auf 1600 m Mehreshöhe in der imposanten Dolomitenbergkulisse am Fuße des Lavarella und Conturines.</p>','<p>Il Campo da beach a San Ciascian (Comune di Alta Badia) è uno dei campi[nbsp] più alti del Alto Adige. Si gioca a 1600 m sopra livello mare davanti alle collone enormi dolomitiche del Lavarell e Conturines.</p>','Sportzone San Ciascian/Alta Badia, Str. Plan 59','Zona sportiva San Ciascian/Alta Badia, Str. Plan 59','San Ciascian/Alta Badia','San Ciascian/Alta Badia'),(10,1461917937,'*L^杦\0>\0e',39040,11.254671,46.345471,'Tennis/Beach-Volley Tramin','Impianti tennis/beach-volley Termeno','','','Weinstrasse 152','Strada del Vino, 152','Tramin','Termeno'),(11,1461918343,'YR杦\0>\0e',39049,11.439338,46.893184,'Balneum Sterzing','Balneum Vipiteno','<p>Das „Balneum Sterzing“ ist ein Sport- und Relaxbad für die ganze Familie und bietet im Sommerbetrieb Platz für mehr als 1.000 Badegäste und Sportbegeisterte. Das beliebte Schwimmbad bietet auf einer großen Liegewiese, mit sonnigen und schattigen Plätzen, ein großen Außenbecken mit dem neuen Kinderbecken sowie ein auch im Sommer zugänglichen Innenbecken!</p>\n<p><span style=\"line-height: 1.3em;\">Das Restaurant mit sonniger Terrasse bietet allen Gästen den ganzen Tag über Erfrischungsgetränke und Essen!</span></p>','<p>La piscina è un impianto per tutta la famiglia. In estate può ospitare circa 1.000 ospiti. All\'aperto il Balneum offre un prato grande con posti al sole e all\'ombra, una piscina grande e anche una nuova piscina per i bambini. Il campo da beach fu rinnovato nella primavera del 2012.</p>','Karl-Riedmann-Platz 5','Piazza Karl-Riedmann 5','Sterzing','Vipiteno'),(12,1461918545,'r^/S杦\0>\0e',39031,11.947522,46.792163,'Freibad Bruneck','Piscina scoperta Brunico','<p>Die Beachvolleyballanlage im Brunecker Freischwimmbad zählt zu den schönsten unseres Landes. Die vier ausgezeichnet präparierten Beachplätze sind mit demselben Quarzsand wie beim jährlich stattfindenden Weltcup in Klagenfurt ausgestattet. Im Frühjahr 2012 wurden die Innenplätze generalsaniert und bieten ideale Verhältnisse für spannende Duelle im Sand. Weiters stehen vor dem Freischwimmbad, wie schon in den letzten Jahren, zwei weitere Beachplätze den ganzen Sommer zur Verfügung.</p>','<p>L\'impianto di beachvolley, che si trova presso la piscina all\'aperto di Brunico, è uno dei più belli della nostra provincia. I due campi interni risanati nel 2012 si mostrano in condizioni ottime e sono preparati con la stessa sabbia usata al torneo di coppa del mondo di Klagenfurt. Al esterno della piscina ci si trovano altri due impianti dove si può praticare il beachvolley per tutto l\'estate.</p>','Neurauthstrasse 1','Via Neurauth 1','Bruneck','Brunico');
