ending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,16,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(17,12,'tl_article',64,1462947008,'text','a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:14:\"Reglement 2016\";}','<p><strong><u>Spielregeln:</u><br></strong>Beim Raiffeisen Beachcup wird nach den internationalen Beachvolleyball-Regeln der FIVB gespielt. Mehr Informationen dazu finden Sie auf der Homepage der FIVB oder hier: <a href=\"{{file::7d88c6ef-11e1-11e6-9da6-00163e006592}}\" target=\"_blank\">FIVB-Spielregeln auf Deutsch</a></p>\n<p><u><strong>Technische Richtlinien für die Austragung der Beachcup Jugend-Etappen</strong></u></p>\n<p>Das OK des Beachcup möchte in Zusammenarbeit mit der FIPAV Bozen einige Grundsätze schaffen um der Jugendförderung im Beachvolleyball in Südtirol gerecht zu werden.</p>\n<p>Die Richtlinien findet ihr hier: <a href=\"{{file::e6bed88a-173e-11e6-9da6-00163e006592}}\" target=\"_blank\">Jugend-Spielregeln</a></p>\n<p><u><strong>Teilnahmeberechtigt:</strong></u></p>\n<p><strong>Am „Raiffeisen Beachcup“ können alle Sportler/Innen welche beim Fachsportverband FIPAV tesseriert sind und von ihrem Verein nicht für die Aktivität Beachvolleyball über das Online Portal der FIPAV gesperrt sind, teilnehmen. Jene die nicht über eine Tesserierung beim Fachsportverband FIPAV verfügen, können bei der Einschreibung (Anmeldeformular) eine sogenannte Tagestesserierung „tesseramento per evento“ beantragen, welche vorbehaltlich dessen Annahme zur Teilnahme an den Turnieren berechtigt.</strong>[nbsp]</p>\n<p><u>Kategorie Open Herren/Damen:</u></p>\n<p>Die Teilnahme am Turnier wird nur nach Vorlage eines[nbsp]gültigen ärztlichen Zeugnises (Hausarzt oder Sportarzt) gewährt, welches die uneingeschränkte Eignung für die Ausübung dieser Sportart bescheinigt![nbsp]</p>\n<p><u>Kategorie Freizeit Herren:<br></u>Es sind alle Sportler teilnahmeberechtigt, welche[nbsp]ein gültiges ärztliches Zeugnis (Hausarzt oder Sportarzt) vorweisen können und[nbsp]in der abgelaufenen Hallen-Saison maximal in der italienischen Serie D und noch nie in der italienischen Serie B2 oder höher[nbsp]gespielt haben. Die selbe Einschränkung wird auf andere Ligen im Ausland angewendet. Zudem sind die Halbfinalisten der Raiffeisen Beachcup Open Etappen der letzten beiden Jahre hier[nbsp]<u>nicht</u>[nbsp]spielberechtigt. Spielberechtigt sind auch Teams, bei denen beide Spieler älter als 40 sind oder ein Spieler jünger als 16 ist.</p>\n<p>Für Frauen- oder Mixed-Teams gibt es keine getrennte Wertung und keine Begrenzung bezüglich ihres Spielniveaus.[nbsp]</p>\n<p>Das OK des Beachcups behält sich das Recht vor einzelne Spieler oder Mannschaften aufgrund ihrer Spielstärke die Teilnahme in dieser Kategorie zu erlauben oder zu verwehren.</p>\n<p><u>Kategorie Jugend:<br></u></p>\n<p>Es sind alle SportlerInnen teilnahmeberechtigt, welche[nbsp]ein gültiges ärztliches Zeugnis (Hausarzt oder Sportarzt) vorweisen können. Es gelten folgende Altersbeschränkungen:</p>\n<p>U18 w: [nbsp]geboren nach dem 01.01.1999</p>\n<p>U17 m: [nbsp]geboren nach dem 01.01.2000</p>\n<p>U16 w: [nbsp]geboren nach dem 01.01.2001</p>\n<p>U15 m: [nbsp]geboren nach dem 01.01.2002</p>\n<p>U14 w: [nbsp]geboren nach dem 01.01.2003</p>\n<p>U13 m: [nbsp]geboren nach dem 01.01.2004</p>\n<p><strong><u>Einschreibungen:</u></strong></p>\n<p>Die Anmeldungen können ausschließlich online auf <strong>www.beachcup.it </strong>bis innerhalb Mittwoch 18:00 Uhr vor der jeweiligen Etappe gemacht werden, solange noch freie Plätze verfügbar sind. Die Einschreibung ist nur gültig, wenn die <a href=\"{{file::109c5586-11f9-11e6-9da6-00163e006592}}\" target=\"_blank\">Eigenerklärung bzw. Datenschutzerklärung</a> sowie das ärztliche Attest ebenfalls innerhalb Mittwoch 18:00 Uhr vor der jeweiligen Etappe entweder an die Faxnummer 0474 05 06 08 oder an[nbsp] <a href=\"mailto:info@beachcup.it\">info@beachcup.it</a>[nbsp]gesendet wird. [nbsp]Weitere Infos unter Tel. +39 393 7064116 oder per mail: <a href=\"mailto:info@beachcup.it\">info@beachcup.it</a></p>\n<p><strong><u>Turniermodus:</u></strong></p>\n<p>Die Veranstaltung gliedert sich in mehrere Etappen und unterschiedliche Kategorien (Details zu jeder Etappe unter Turniere 2016).[nbsp]Die Turniere finden bei jeder Witterung statt.</p>\n<p>Spielkategorien:</p>\n<p>- Open Damen [&][nbsp]Herren<br>- Freizeit Herren<br>- Jugend U18 Mädchen [&] U17 Buben<br>- Jugend U16 Mädchen [&] U15 Buben<br>- Jugend U14 Mädchen [&] U13 Buben</p>\n<p>Es ist aus organisatorischer Sicht nicht möglich, an einem Tag an zwei Bewerben teilzunehmen. Bei den Gruppenspielen wird ein Satz mit mindestens 15 Punkten im Rally-Point System gespielt, wobei ein Mindestvorsprung von 2 Punkten notwendig ist. Die erst- und zweitplatzierte Mannschaft qualifizieren sich für die nächste Runde. Bei den darauf folgenden Spielen wird ein Satz bis 21 Punkten gespielt. Das Finale wird in 2 Gewinnsätzen entschieden (3. Satz bis 15 Punkte).</p>\n<p>Erscheint eine Mannschaft nicht innerhalb 5 Minuten zu einem Spiel (Zeitplan laut Spielplan), wird das Spiel als verloren gewertet und zwar mit 15:8 bzw. 21:11.</p>\n<p>Für die U13- und U14-Jugendbewerbe wird in einem Feld von 7 X 14 m gespielt, alle anderen Bewerbe spielen auf einem Spielfeld mit 8 x[nbsp]16 m. Die Netzhöhen gelten wie folgt:</p>\n<p>U14w- 2,05m | U13m - 2,05m</p>\n<p>U16w - 2,20m | U15m - 2,20m</p>\n<p>U18w/Damen - 2,24m | U17m/Herren - 2,43m</p>\n<p><strong><u>Gesamtwertung:</u><br></strong><strong>Open:[nbsp]</strong>Für die Gesamtwertung werden die Punkte der drei Etappen zusammengezählt. Sollten 2 oder mehrere Mannschaften in der Gesamtwertung dieselbe Punktezahl aufweisen, wird das Team besser gewertet, das mehr Teilnahmen am Raiffeisen Beachcup hatte. Bei neuerlichem Gleichstand entscheidet die beste Platzierung in der Turnierserie.</p>\n<p><strong>Freizeit Herren:</strong>[nbsp]Für die Gesamtwertung werden die Punkte der zwei Freizeitturniere und der drei Open-Turniere zusammengezählt, wobei nur die besten vier Etappen gewertet werden.</p>\n<p>In den<strong> Jugend-Kategorien </strong>gibt[nbsp]es keine Gesamtwertung.</p>\n<p><strong>Punktevergabe:<br></strong>1. Platz - 100 Punkte<br>2. Platz - 90 Punkte<br>3. Platz - 80 Punkte<br>4. Platz - 70 Punkte<br>Verlierer Viertelfinale - 60 Punkte<br>Verlierer Achtelfinale - 50 Punkte<br>Gruppendrittletzter - 40 Punkte<br>Gruppenvorletzter - 30 Punkte<br>Gruppenletzter - 20 Punkte</p>\n<p>Die Punkte werden pro Mannschaft vergeben.<br><strong>Bei der letzten Etappe wird die doppelte Punktezahl vergeben.<br></strong><strong>(1. Platz - 200 Punkte.; 2. Platz - 180 Punkte; 3. Platz - 160 Punkte; usw.)</strong></p>\n<p><strong><u>Nenngebühr*:</u><br></strong>Die Nenngebühr beinhaltet den Eintritt in die jeweiligen Schwimmbäder (falls vorhanden), sowie einmal für die gesamte Tour ein Spielleibchen des \"Raiffeisen Beachcup\" pro Spieler. \"Bank The Future\" Kunden erhalten eine Ermäßigung von 20%.</p>\n<p>Jedes weitere Spielleibchen wird vom Veranstalter gegen den Unkostenbeitrag von € 15,00 weitergegeben (Materialkosten und Aufdruck).</p>\n<table>\n<tbody>\n<tr>\n<td>\n<p><strong>Kategorie</strong></p>\n</td>\n<td>\n<p><strong>Nenngebühr Erstteilnahme</strong></p>\n</td>\n<td>\n<p><strong>jede weitere Etappe</strong></p>\n</td>\n<td>\n<p><strong>Bank The Future Kunden</strong></p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Open</p>\n</td>\n<td>\n<p>55 Euro</p>\n</td>\n<td>\n<p>45 Euro</p>\n</td>\n<td>\n<p>20% Ermäßigung</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Freizeit</p>\n</td>\n<td>\n<p>45 Euro</p>\n</td>\n<td>\n<p>35 Euro</p>\n</td>\n<td>\n<p>20% Ermäßigung</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Jugend</p>\n</td>\n<td>\n<p>35 Euro</p>\n</td>\n<td>\n<p>25 Euro</p>\n</td>\n<td>\n<p>20% Ermäßigung</p>\n</td>\n</tr>\n</tbody>\n</table>\n<p><u><strong>*WICHTIG:</strong></u>[nbsp]für Spieler welche noch nicht beim Fachsportverband „FIPAV“ gemeldet sind und über das Einschreibeformular (Datenschutzerklärung) eine Tagestesserierung „tesseramento per evento“ beantragen fallen zusätzlich 2,00 € pro Etappe an.</p>\n<p>Erscheint eine Mannschaft nicht zu einer Etappe ohne sich vorher rechtzeitig abzumelden, muss die Einschreibegebühr trotzdem entrichtet werden.</p>\n<p><strong><u>Spielbekleidung:</u><br></strong>Die Spieler müssen[nbsp]<u>immer</u>[nbsp]mit den offiziellen Turnierdressen spielen.</p>\n<p><strong><u>Spielball:</u><br></strong>Der offizielle Spielball des \"Raiffeisen Beachcup\" ist der Mikasa VLS300. Dieser wird [nbsp]für die Spiele[nbsp]vom OK[nbsp]zur Verfügung gestellt.</p>\n<p><strong><u>Preisgeld pro Turnier:</u></strong></p>\n<p><u>Kategorie Open Herren [&] Damen:<br></u>Erstplatzierte Mannschaft € 100,00 und Sachpreise für die ersten vier Mannschaften</p>\n<p><u>Kategorien Freizeit Herren:<br></u>Sachpreise für die ersten vier Mannschaften.</p>\n<p><u>Kategorie Jugend:<br></u>Sachpreise.</p>\n<p><strong><u>Preisgeld Gesamtwertung:</u></strong></p>\n<p><u>Kategorie Open Herren [&] Damen:<br></u>Platz 1: 400 €</p>\n<p>Platz 2: 200 €</p>\n<p>Platz 3: 100 €</p>\n<p><u>Kategorien Freizeit Herren:<br></u>Sachpreise für die ersten drei Mannschaften.</p>\n<p><strong>Preisverteilung:<br></strong>Die Preisverteilung findet stets nach Beendigung des Turniers statt. Die ersten vier Mannschaften werden prämiert.</p>\n<p><strong>Rahmenprogramm:<br></strong>Bei den einzelnen Etappen werden verschiedene Rahmenprogramme geboten. Details dazu findet man unter dem Link des jeweiligen Veranstaltungsortes auf Turniere 2016.</p>\n<p><strong>Organisation:<br></strong>Der RAIFFEISEN BEACHCUP wird vom SSV Bruneck Amateursportverein - Sektion Volleyball koordiniert und von den jeweiligen lokalen Veranstaltern organisiert. Details dazu findet man unter dem Link des jeweiligen Veranstaltungsortes auf Turniere 2016.</p>\n<p>Das Organisationskomitee fungiert lediglich als Koordinator der Tour.[nbsp]Die einzelnen Turniere werden selbstständig von den lokalen Organisatoren durchgeführt.</p>\n<p>Die Teilnahme erfolgt auf eigenes Risiko. Der Korrdinator und die lokalen Veranstalter übernehmen keinerlei Haftung für Unfälle vor, während und nach den Turnieren, auch nicht Dritten gegenüber. Jeder einzelne Spieler trägt die volle persönliche Verantwortung für seinen Gesundheitszustand.</p>\n<p><strong>Änderungen:</strong></p>\n<p>Der Veranstalter behält sich die Möglichkeit vor, Programmänderungen durchzuführen. Die Internetseite www.beachcup.it ist die offizielle Informationsquelle der Veranstaltung. Aus diesem Grund sind alle offiziellen Mitteilungen auf dieser Seite zu finden.</p>','',NULL,'','','','','','','','above',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,0,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(79,3,'tl_news',128,1462887566,'text','a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:0:\"\";}','<p>È tempo di ricominciare la stagione estiva e così il Raiffeisen Beachcup ha determinato le date della sua serie di tornei di beach volley. Gli organizzatori dell’OK si sono dati da fare per sviluppare un sistema categorico che potesse soddisfare maggior parte delle richieste. Inoltre, come vedete, è stato realizzato un nuovo sito internet.</p>\n<p>I tornei di beach volley della serie Raiffeisen Beachcup offrono la possibilità a giocatori di ogni livello e età di misurarsi sulla sabbia dei tanti campi da beach volley dell‘Alto Adige. Come già da sempre, ci sarà la categoria OPEN femminile e maschile, alla quale potranno partecipare giocatori di qualsiaso livello, quindi anche pallavolisti di altissimo livello. Ogni anno il livello di gioco si alza, grazie a tanti giocatori di successo provenienti da diverse parti d’Italia, Germania e Austria. Una tappa dell’OPEN si svolgerà la prima volta a S. Cassiano. A 1.500 metri d’altitudine le partite di questo alto livello diventeranno ancora più pesanti, ma anche entusiasmanti. Per gli uomini ci sarà di nuovo la categoria AMATORIALE, dato che ogni anno il numero dei partecipanti aumenta. Qui non sono amessi giocatori di livello troppo alto. Le limitazioni le trovate qui su questo sito sotto <a href=\"{{link_url::45}}\" target=\"_blank\">regolamento</a>. Una nuova tappa AMATORIALE verrà svolta a Chiusa, oltre alla solita tappa di Vipiteno.</p>\n<p>Anche nella categoria GIOVANILE ci sarà un nuovo luogo di manifestazione, cioè Termeno. Nel GIOVANILE si riconosce una costante crescita del numero di partecipanti. Quest’anno questi tornei quindi sono stati adattati al sistema categorico italiano e così si giocherà tornei U13, U15 e U17 nel maschile e U14, U16 e U18 nel femminile. I campionati provinciali VSS per i giovani, ma anche per gli adulti, si svolgeranno come anche già l’anno scorso in un tappa singola. Questa si svolgerà a Brunico sotto il dominio del nuovo partner VSS il 13 e 14 agosto.</p>\n<p><strong>L\'iscrizione alla prima tappa a Tirolo sará possibile a partire dal 23 maggio.</strong></p>\n<p>Gli organizzatori dei luoghi delle diverse tappe e l’OK-team sono pronti a realizzare di nuovo i tornei di successo della serie Raiffeisen Beachcup e sperano quindi di riuscire a coinvolgere un altra volta tanti appassionati di beach volley e giocare delle partite mozzafiato in un ambiente amichevole sotto il sole altoatesino.</p>','1',' BO杦\0>\0e','','','a:3:{i:0;s:3:\"200\";i:1;s:0:\"\";i:2;s:12:\"proportional\";}','a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:2:\"20\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:2:\"px\";}','','','','left',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,0,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(18,13,'tl_article',256,1460811207,'text','a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:36:\"Beachvolley Landesmeisterschaft 2015\";}','<p>Auch 2015 werden die Südtiroler Beachvolleyball-Landesmeister wieder im Rahmen des Raiffeisen Beachcups gekürt. Die Landesmeisterschaft wird vom Raiffeisen Beachcup Organisationskomittee in Zusammenarbeit dem dem italienischen Volleyballverband der Provinz Bozen in der schönen Beachanlage beim Freibad von Bruneck organisiert.[nbsp]</p>\n<p>Am 15.08.2015 werden die Landesmeister der Kategorien Damen, Herren und U16 ermittelt. Am Sonntag folgen dann die Spiele der Jugendkategorien U14 und U18 jeweils männlich und weiblich.[nbsp]Bei diesem Turnieren können nur Mannschaften bzw. Spieler der Provinz Bozen teilnehmen.[nbsp]</p>\n<p><img src=\"http://www.beachcup.it/images/stories/sponsoren/fipavbz.png\" alt=\"\" width=\"144\" height=\"144\"></p>','',NULL,'','','','','','','','above',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,0,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(20,15,'tl_article',128,1460103956,'module','',NULL,'',NULL,'','','','','','','','above',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,19,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(21,16,'tl_article',128,1460195574,'module','',NULL,'',NULL,'','','','','','','','above',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,20,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(29,9,'tl_article',32,1460801825,'module','',NULL,'',NULL,'','','','','','','','above',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,26,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(32,40,'tl_article',128,1460803079,'module','a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:0:\"\";}',NULL,'',NULL,'','','','','','','','above',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,24,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(33,42,'tl_article',128,1460802514,'module','',NULL,'',NULL,'','','','','','','','above',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,16,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(34,43,'tl_article',64,1462947058,'text','a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:16:\"Regolamento 2016\";}','<p><strong><u>Regole di gioco:</u><br></strong>Per il \"Raiffeisen Beachcup\" valgono le regole internazionali del beach volley. Ulteriori informazioni sulle regole le trovate sul sito ufficiale FIVB o scaricando: <a href=\"{{file::ab497454-11f8-11e6-9da6-00163e006592}}\" target=\"_blank\">Regole di gioco FIVB</a>.</p>\n<p><u><strong>Direttive tecniche riguardo lo svolgimento delle tappe giovanili del Beachcup</strong></u></p>\n<p>L’OK Team del Beachcup vorrebbe definire alcune regole di base in collaborazione con la FIPAV Bolzano, per garantire il continuo incremento del settore giovanile nel beach volley in Alto Adige.</p>\n<p><a href=\"{{file::e6bed86d-173e-11e6-9da6-00163e006592}}\" target=\"_blank\">Scarica il regolamento</a></p>\n<p><strong>Condizioni per la partecipazione:</strong></p>\n<p><strong>Al Raiffeisen Beachcup possono partecipare tutti gli atleti tesserati FIPAV e dei quali la società di appartenenza non ha dato il divieto per l\'attività di beach volley tramite il portale FIPAV online. Tutti i non tesserati presso la Federazione Italiana Pallavolo FIPAV possono richiedere tramite il modulo di iscrizione (liberatoria) un \"tesseramento per singola manifestazione amatoriale\" quale salvo accettazione autorizza alla partecipazione al singolo torneo/tappa.<br></strong></p>\n<p><u>Categoria \"OPEN\" Uomini/Donne:<br></u></p>\n<p>La partecipazione al torneo è consentita solo presentando[nbsp]un <strong>certificato medico valido </strong>(medico di fiducia o medico sportivo) che certifica l\'idoneità illimitata per lo sport praticato.</p>\n<p><u>Categoria \"AMATORIALE Uomini“:<br></u>Possono partecipare tutti gli atleti in possesso di un <strong>certificato medico valido </strong>(medico di fiducia o medico sportivo) che certifica l\'idoneità illimitata per lo sport praticato e che nella stagione invernale hanno al massimo giocato nel campionato italiano di Serie D e che in carriera non hanno mai giocato nel campionato italiano di Serie B2 o superiore. Questo vale anche per tutti i campionati paragonabili di un\'altro paese. Anche i giocatori semifinalisti della categoria Open delle utlime due edizioni del Raiffeisen Beachcup sono esclusi. Possono participare anche squadre con atleti oltre i 40 anni o squadre con un atleta sotto i 16 anni.<br>Il comitato organizzatore si riserva di escludere anche singoli giocatori o squadre ritenute di alto livello. Per le coppie mixed non c\'è una classifica separata e nessuna limitazione riguardante il loro livello di gioco.</p>\n<p><u>Categoria giovanile:</u></p>\n<p>Tutti i giovani devono presentare un <strong>certificato medico valido</strong> (medico di fiducia o medico sportivo) che certifica l\'idoneità illimitata per lo sport praticato. Si gioca nelle seguenti categorie:</p>\n<p>U18 femminile: nati dopo il 01.01.1999</p>\n<p>U17 maschile: nati dopo il 01.01.2000</p>\n<p>U16 femminile: nati dopo il 01.01.2001</p>\n<p>U15 maschile: nati dopo il 01.01.2002</p>\n<p>U14 femminile: nati dopo il 01.01.2003</p>\n<p>U13 maschile: nati dopo il 01.01.2004</p>\n<p><strong>Iscrizioni:</strong></p>\n<p>L\'iscrizione può essere fatta soltanto online sul sito <strong>www.beachcup.it</strong> entro le ore 18:00 del mercoledì precedente ad ogni singola tappa e fino all\' esaurimento dei posti liberi. L\'iscrizione è valida solo se entro le ore 18:00 del mercoledì precedente alla prima tappa di partecipazione del atleta la <a href=\"{{file::e9a07924-1208-11e6-9da6-00163e006592}}\" target=\"_blank\">liberatoria</a> e il certificato medico sono stati mandati al numero fax 0474 05 06 08 o a <a href=\"mailto:info@beachcup.it\">info@beachcup.it</a>. [nbsp] Informazioni: Tel. +39 393 7064116 o via email: <a href=\"mailto:info@beachcup.it\">info@beachcup.it</a></p>\n<p><strong>Modalità del torneo:</strong></p>\n<p>L\'evento è composto da più tappe e diverse categorie. (Dettagli sulle singole tappe vedasi sotto Tornei 2016).[nbsp]</p>\n<p><br>Categorie:<br>- Open femminile e[nbsp]maschile<br>- Amatoriale maschile<br>- Under 18 femminile e Under 17 maschile<br>- Under 16 femminile e Under 15 maschile<br>- Under 14 femminile e Under 13 maschile</p>\n<p>Non è possibile iscriversi a piu di una categoria in una giornata.</p>\n<p>Nella fase di qualificazione (giochi di gruppo) si gioca un set fino ad un mimimo di 15 punti (Rally-Point System). Per la vittoria è necessario avere due punti di vantaggio. Le prime due squadre di ogni gruppo si qualificano per il turno successivo. Dagli ottavi si gioca un set fino a 21 punti. La finale verrà decisa in due set vincenti (3. Set fino a 15 punti).</p>\n<p>Se una squarda dopo l\'annuncio della partita (previsto dal tabellone) non si presenta entro cinque minuti sul campo da gioco, la partita sarà persa col punteggio di 15:8 o 21:11.</p>\n<p>Per le categorie U13 e U14 il campo da gioco sara ridotto su 7 x 14 m, tutte le altre categorie si giocano sul campo 8 x 16 m. Per l\'altezza rete vale:</p>\n<p>U14f - 2,05m | U13m - 2,05m</p>\n<p>U16f - 2,20m | U15m - 2,20m</p>\n<p>U18f/Donne - 2,24m | U17/Uomini - 2,43m</p>\n<p>[nbsp]</p>\n<p><strong>Classifica finale:</strong></p>\n<p><u>Open:</u> La somma dei punti di ogni tappa della squadra partecipante dà il risultato finale. Nel caso in cui 2 o più squadre abbiano lo stesso punteggio nella classifica finale, decide il maggior numero di partecipazioni al Raiffeisen Beachcup. In caso di parità viene presa in considerazione il miglior piazzamento.</p>\n<p><u>Amatoriale maschile:</u> Le tre tappe della categoria \"Amatoriale\" e le due tappe \"Open\" valgono per la classifica finale amatoriale però nella classifica finale contano solo i quattro piazzamenti migliori (punteggio!!!). Per la paritá punti conta come descritto per l\'OPEN.</p>\n<p><u>Giovanile</u>: Non è previsto una classifica finale.</p>\n<p><strong>Punti: I punti vanno aggiudicati a squarda.<br></strong>1° posto - 100 punti<br>2° posto - 90 punti<br>3° posto - 80 punti<br>4° posto - 70 punti<br>squadra perdente ai quarti - 60 punti<br>squadra perdente agli ottavi - 50 punti<br>terzultima classificata nel gruppo - 40 punti<br>penultima classificata nel gruppo - 30 punti<br>ultima classificata nel gruppo - 20 punti<br>I punti verranno aggiudicati a squadra.<br><strong>L\'ultima tappa dà il doppio dei punti.<br></strong><strong>(1° posto - 200 punti; 2° posto - 180 punti; 3° posto - 160 punti; ecc.)</strong></p>\n<p><strong>Quota d\'iscrizione:<br></strong>Nella quota d\'iscrizione è inclusa l\'entrata nella rispettiva piscina (se disponibile) e inoltre una maglietta del \"Raiffeisen Beachcup\" per giocatore per tutte le tappe.<br>I clienti \"Bank The Future\" hanno diritto ad uno sconto del 20%.</p>\n<p>Per ogni ulteriore maglietta verranno richieste le spese d\'acquisto di € 15,00 (materiale e stampa).</p>\n<table>\n<tbody>\n<tr>\n<td>\n<p>Categoria</p>\n</td>\n<td width=\"197\">\n<p>prima tappa partecipata</p>\n</td>\n<td width=\"149\">\n<p>tappe successive</p>\n</td>\n<td width=\"195\">\n<p>clienti \"Bank The Future\"</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Open</p>\n</td>\n<td width=\"197\">\n<p>55 Euro</p>\n</td>\n<td width=\"149\">\n<p>45 Euro</p>\n</td>\n<td width=\"195\">\n<p>20% di sconto</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Amatoriale</p>\n</td>\n<td width=\"197\">\n<p>45 Euro</p>\n</td>\n<td width=\"149\">\n<p>35 Euro</p>\n</td>\n<td width=\"195\">\n<p>20% di sconto</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Giovanile</p>\n</td>\n<td width=\"197\">\n<p>35 Euro</p>\n</td>\n<td width=\"149\">\n<p>25 Euro</p>\n</td>\n<td width=\"195\">\n<p>20% di sconto</p>\n</td>\n</tr>\n</tbody>\n</table>\n<p><strong>Importante:</strong> Per partecipanti che <u>non</u> sono regolarmente tesserati presso la Federazione Italiana Pallavolo FIPAV e che tramite modulo di iscrizione (liberatoria) richiedono un \"tesseramento per songola manifestazione amatoriale\" sono tenuti a corrispondere ulteriori 2,00€ per tappa/torneo.</p>\n<p>Se una squadra non si presenta ad una tappa senza aver tempestivamente disdetto, deve pagare ugualmente la quota d\'iscrizione.</p>\n<p><strong>Vestiario:<br></strong>I giocatori sono obbligati ad usare <u>sempre</u> la maglietta ufficiale del torneo durante le partite.</p>\n<p><strong>Pallone di gioco:<br></strong>Il pallone ufficiale del \"Raiffeisen Beachcup\" è il Mikasa VLS300. Il pallone per le partite viene fornito dall\'O.K..</p>\n<p><strong>Montepremi per singola tappa:</strong></p>\n<p>Categoria Open maschile e femminile:<br>1a squadra classificata 100 €, premi vari per le prime quattro squadre classificate</p>\n<p>Categoria amatoriale:</p>\n<p>Premi vari per le prime quattro squadre classificate</p>\n<p>Categoria giovanile:</p>\n<p>Premi vari.</p>\n<p><strong>Montepremi per la classifica finale:</strong></p>\n<p>Categoria Open maschile e femminile:<br>1° posto: 400 €<br>2° posto: 200 €<br>3° posto: 100 €</p>\n<p>Categoria amatoriale:</p>\n<p>Premi vari per le prime tre squadre classificate</p>\n<p><strong>Premiazione:<br></strong>La premiazione avverrà direttamente dopo ogni torneo.</p>\n<p><strong>Programma:<br></strong>Durante tutte le tappe vengono offerti dei programmi speciali. Per informazioni dettagliate vedere la pagina dell\' organizzatore locale seguendo l\'apposito link sotto Tornei 2016.</p>\n<p><strong>Organizzazione:<br></strong>Il \"Raiffeisen Beachcup\" viene coordinato dalla società SSV Bruneck Amateursportverein sezione pallavolo e organizzato dai vari organizzatori locali. Per informazioni dettagliate vedere la pagina dell\' organizzatore locale seguendo l\'apposito link sotto Tornei 2016.</p>\n<p>Il comitato organizzativo funge solo come coordinatore del tour.[nbsp]Alle singole tappe provvedono gli organizzatori locali.</p>\n<p>La partecipazione è a proprio rischio. Il corrdinatore e gli organizzatori respingono ogni responsabilità per infortuni prima, durante e dopo i tornei, neanche contro terzi. Ogni atleta è responsabile personalmente per la propria salute.</p>\n<p><strong>Modifiche:</strong></p>\n<p>In caso di necessità il comitato organizzativo può modificare il regolamento in ogni momento per garantire un buon funzionamento del torneo. Il sito internet www.beachcup.it è l\'ufficale fonte di informazione della manifestazione. Per questa ragione tutte le comunicazioni saranno publicate su quel sito.</p>','',NULL,'','','','','','','','above',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,0,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(35,44,'tl_article',256,1460803844,'text','a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:27:\"Campionato Provinciale 2015\";}','<p>Anche nel 2015 i campioni provinciali beach volley verranno individuati nel contesto del Raiffeisen Beachcup. Cosi prosegue per un altro anno la collaborazione tra il Raiffeisen Beachcup e la federazione pallavolo italiana FIPAV comitato provinciale bolzano. Il torneo si svolgerà a Brunico sui campi da beach presso la splendida piscina scoperta.[nbsp]</p>\n<p>Sabato 15 agosto 2015 si giocherà per i titoli nelle categorie uomini, donne e U16, mentre domenica 16 agosto 2015 verranno eletti i campioni nelle categorie giovanili U14 e U18 maschili e femminili.[nbsp]Possono partecipare solo coppie della provincia di Bolzano.</p>\n<p><img src=\"http://www.beachcup.it/images/stories/sponsoren/fipavbz.png\" alt=\"\" width=\"144\" height=\"144\"></p>\n<p>[nbsp]</p>','',NULL,'','','','','','','','above',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,0,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(36,46,'tl_article',128,1460802514,'module','',NULL,'',NULL,'','','','','','','','above',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,19,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(37,47,'tl_article',128,1460802514,'module','',NULL,'',NULL,'','','','','','','','above',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,20,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(38,49,'tl_article',128,1460992656,'html