</p>\n<p><strong>Cosa sono i Cookies?</strong><br>Un cookie è un piccolo file di testo che i siti salvano sul tuo computer o dispositivo mobile mentre li visiti. Grazie ai cookies il sito ricorda le tue azioni e preferenze (per es. login, lingua, dimensioni dei caratteri e altre impostazioni di visualizzazione) in modo che tu non debba reinserirle quando torni sul sito o navighi da una pagina all\'altra.</p>\n<p><strong>Perchè utilizziamo Cookies?</strong><br>Utilizziamo queste informazioni per migliorare il nostro sito e per offrire ai visitatori un offerta migliore. Il nostro sito utilizza anche Cookie di parti terze.</p>\n<p><strong>Tipi di Cookies</strong><br>Questo sito utilizza i seguenti tipi di Cookies:</p>\n<ul>\n<li>Cookie tecnici e cookie analitici: questi Cookies ci danno informazioni su come viene utilizzato il nostro sito e ci permettono di migliorarlo. Questi Cookie in parte vengono forniti da parti terze (Google) e sono anonimizzate.</li>\n<li>Cookie di parti terze: esempi per questi Cookie di parti terze sono i “social plugins” di Facebook, Twitter e Google+. Questi permettoni di semplificare il processo di condivisione di contenuti su queste piattaforme. Ulteriori informazioni su questi cookie sono disponibili presso i fornitori di questi servizi.</li>\n</ul>\n<p><strong>Gestione dei Cookie</strong><br>Puoi controllare e/o verificare i cookies come vuoi – per saperne di più, vai su AllAboutCookies.org. Puoi cancellare i cookies già presenti nel computer e impostare quasi tutti i browser in modo da bloccarne l\'installazione. Se scegli questa opzione, dovrai però modificare manualmente alcune preferenze ogni volta che visiti il sito ed è possibile che alcuni servizi o determinate funzioni non siano disponibili.</p>','',NULL,'','','','','','','','above',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,0,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(44,4,'tl_news',128,1462949388,'text','a:2:{s:4:\"unit\";s:2:\"h3\";s:5:\"value\";s:0:\"\";}','<p>Die Beachvolleyballsaison kann losgehen und dafür wurden auch die Termine der Raiffeisen Beachcup Turnierserie festgelegt. Das OK Team hat sich wieder Mühe gegeben, die Etappen und Kategorien so zu gestalten, dass die Nachfrage möglichst gedeckt wird. Wie ihr seht, wurde zusätzlich an einem neuen Internetauftritt gearbeitet.</p>\n<p>Die Raiffeisen Beachvolleyballturniere sind für jegliche Altersklassen und Levels, sodass sich auch jeder auf dem Sand der vielen Beachvolleyballplätze in Südtirol messen kann. Wie schon in den letzten Jahren gibt es wieder die Kategorie OPEN, sowohl für Damen, als auch für Herren, an der Spieler jedes Niveaus teilnehmen können. Jedes Jahr verstärkt sich das Teilnehmerfeld durch erfogreiche Volleyballspieler, die aus den verschiedensten Ecken Italiens, Deutschlands und Österreichs anreisen. Eine herausfordernde Etappe wird die OPEN in St. Kassian sein, wo man bisher nur Freizeitetappen veranstaltet hat. Auf 1.500 Metern Höhe kann mit starken Gegnern die Luft schon mal dünn werden. Zusätzlich gibt es wieder die Freizeit Etappen für Männer, an denen nur Beachvolleyballer bis zu einem gewissen Niveau teilnehmen dürfen. Genauere Details dazu findet ihr im <a href=\"{{link_url::11}}\" target=\"_blank\">Reglement</a>. Zusätzlich zu der üblichen Freizeitetappe in Sterzing kommt dieses Jahr ein neuer Austragungsort dazu, und zwar Klausen.</p>\n<p>Tramin hingegen wird neuer Austragungsort für eine Etappe der jugendlichen Kategorien sein, bei der man jedes Jahr eine konstante Steigerung der Teilnehmerzahlen erfährt. Dieses Jahr wurde das Turnierangebot an das italienische Kategoriensystem angepasst und somit gibt es die U13, U15 und U17-Turniere für die Jungs und U14, U16 und U18- Turniere für die Mädchen. Die VSS Landesmeisterschaften für Erwachsene und Jugendliche werden auch dieses Jahr als ein eigenes Turnier ausgetragen, das wieder in Bruneck, unter der Schirmherrschaft des VSS, am 13. und 14. August, stattfinden wird.</p>\n<p><strong>Die Anmeldung zur ersten Etappe in Dorf Tirol wird am 23. Mai freigegeben.</strong></p>\n<p>Das OK-Team und alle Mitveranstalter des jeweiligen Ortes freuen sich wieder die erfolgreiche Raiffeisen Beachcup Serie zu ermöglichen und hoffen auf zahlreiche Anmeldungen, spannende Spiele und natürlich auf viel Spaß in einem freundschaftlichen Umfeld unter strahlenden Sonnenschein.</p>','1',' BO杦\0>\0e','','','a:3:{i:0;s:3:\"200\";i:1;s:0:\"\";i:2;s:12:\"proportional\";}','a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:2:\"20\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:2:\"px\";}','','','','left',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,0,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(42,54,'tl_article',32,1460803564,'module','',NULL,'',NULL,'','','','','','','','above',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,23,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(43,54,'tl_article',64,1460802961,'module','',NULL,'',NULL,'','','','','','','','above',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,11,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(46,42,'tl_article',64,1461333987,'headline','a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:5:\"Tappe\";}',NULL,'',NULL,'','','','','','','','above',NULL,'',N