ams bilden werden, und fahr anschließend mit <a href=\"{{link_url::62}}\">Schritt 2 (Meine Teams)</a> fort.</p>','',NULL,'','','','','','','','above',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,0,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(99,58,'tl_article',96,1463927291,'module','',NULL,'',NULL,'','','','','','','','above',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,37,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(100,61,'tl_article',64,1463940955,'text','a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:22:\"Schritt 2: Meine Teams\";}','<p>Füge hier ein oder mehr Teams hinzu, welche an Turnieren teilnehmen werden, und fahr anschließend mit <a href=\"{{link_url::60}}\">Schritt 3 (Meine Anmeldungen)</a> fort.</p>','',NULL,'','','','','','','','above',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,0,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(101,61,'tl_article',96,1463927393,'module','',NULL,'',NULL,'','','','','','','','above',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,38,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(102,65,'tl_article',64,1463941135,'text','a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:24:\"Fase 1: I miei giocatori\";}','<p>Aggiungi qui due o piú giocatori che formeranno una o piú coppie e prosegui poi con <a href=\"{{link_url::68}}\">Fase 2 (Le mie squadre)</a>.</p>','',NULL,'','','','','','','','above',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,0,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(103,65,'tl_article',96,1463927544,'module','',NULL,'',NULL,'','','','','','','','above',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,37,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(104,66,'tl_article',64,1463941195,'text','a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:22:\"Fase 2: Le mie squadre\";}','<p>Aggiungi qui una o piú squadre che parteciperanno ai tornei e prosegui poi con <a href=\"{{link_url::69}}\">Fase 3 (Le mie iscrizioni)</a>.</p>','',NULL,'','','','','','','','above',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,0,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(105,66,'tl_article',96,1463927628,'module','',NULL,'',NULL,'','','','','','','','above',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,38,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(106,67,'tl_article',32,1463931239,'text','a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:25:\"Fase 3: Le mie iscrizioni\";}','<p>Aggiungi qui una o piú iscrizioni a un torneo della seguente tappa.</p>\n<p><strong>ATTENZIONE:</strong> É consentito a un giocatore di partecipare solo a un torneo in una giornata. Per ulteriori informazioni vedi il <a href=\"{{link_url::45}}\" target=\"_blank\">regolamento di gioco</a>.</p>','',NULL,'','','','','','','','above',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,0,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(107,59,'tl_article',32,1463930537,'text','a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:28:\"Schritt 3: Meine Anmeldungen\";}','<p>Melde hier ein oder mehr Teams zu Turnieren der aktuell freigegebenen Etappe an.</p>\n<p><strong>ACHTUNG:</strong> Ein Spieler darf pro Spieltag nur an einem Turnier teilnehmen. Weitere Infos zu den Anmelderichtlinien im <a href=\"{{link_url::11}}\" target=\"_blank\">Reglement</a>.</p>','',NULL,'','','','','','','','above',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,0,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(110,56,'tl_article',256,1463948117,'hyperlink','a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:0:\"\";}',NULL,'',NULL,'','','','','','','','above',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'{{link_url::58}}','','','Noch nicht registriert?','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,0,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(111,62,'tl_article',256,1463948210,'hyperlink','a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:0:\"\";}',NULL,'',NULL,'','','','','','','','above',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'{{link_url::66}}','','','Non sei ancora registrato?','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,0,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(114,6,'tl_news',128,1465308274,'text','a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:0:\"\";}','<p>Mit unserer neuen Homepage hat sich auch der Anmeldeprozess etwas geändert. Wir hoffen, euch mit diesem Leitfaden dabei helfen zu können.</p>\n<p>[nbsp]</p>\n<p>Zunächst möchten wir darauf hinweisen, daß <strong>immer nur eine Etappe zur Anmeldung freigeschaltet</strong> ist.</p>\n<p>[nbsp]</p>\n<h3>Wir sind ein Team, wie melden wir uns an?</h3>\n<p>Es reicht, wenn <strong>ein Spieler</strong> die Anmeldung für das Team[nbsp]übernimmt, welche wie folgt abläuft:</p>\n<ol>\n<li><a href=\"{{link_url::58}}\" target=\"_blank\">Registrierung</a> durchführen (Nicht vergessen: Aktivierungslink in zugesandtem Mail anklicken)</li>\n<li>Login</li>\n<li>Gebe im Menü \"My Beachcup\"[nbsp]in[nbsp]<strong>Schritt 1 (Meine Spieler)</strong> die Spielerdaten ein</li>\n<li>Stelle im Menü \"My Beachcup\" in <strong>Schritt 2 (Meine Teams)</strong> dein Team zusammen</li>\n<li>Melde im Menü[nbsp]\"My Beachcup\" in <strong>Schritt 3 (Meine Anmeldungen)</strong> dein Team zu einem Turnier an</li>\n</ol>\n<p>Sollte das ausgewählte Turnier nicht bereits ausgebucht sein, erhält eure Anmeldung den Status <strong>\"in Bearbeitung\"</strong> und wird vom Organisations-Team nach Überprüfung auf Regelkonformität auf <strong>\"bestätigt\"</strong> gesetzt. Sollte das Turnier ausgebucht sein, erhält eure Anmeldung den Status <strong>\"Turnier ausgebucht, auf Warteliste\"</strong>. Den Status <strong>\"unvollständig\"</strong> erhält eure[nbsp]Anmeldung für den Fall, daß die ärztlichen Zeugnisse und/oder die Eigenerklärungen[nbsp]nicht vollständig eingereicht wurden. Näheres zu Einreichemöglichkeiten und Einreichefrist dieser Dokumente findet ihr im <a href=\"{{link_url::11}}\" target=\"_blank\">Reglement</a> im Abschnitt[nbsp]\"Einschreibungen\".</p>\n<p>Spielerdaten und Teamzusammenstellungen bleiben natürlich für alle weiteren[nbsp]Etappen in deinem Loginbereich erhalten. Es ist natürlich möglich, mehr als zwei Spieler und mehr als ein Team anzulegen, für den Fall, daß man die Teamzusammenstellung wechselt.</p>\n<p>[nbsp]</p>\n<h3>Wir sind eine Gruppe/Verein, wie melde ich unsere[nbsp]Teams an?</h3>\n<p>Es reicht, wenn der[nbsp]Gruppenleiter oder[nbsp]Trainer/Betreuer die oben genannten Schritte durchführt, d.h. alle Teilnehmer zunächst als Spieler anlegt, die Teams zusammenstellt und die Anmeldugen durchführt.</p>\n<p>Auch hier gilt, daß jederzeit neue Spieler hinzugefügt und neue Teams zusammengestellt werden können.</p>\n<p>[nbsp]</p>\n<p>Wir hoffen, euch damit geholfen zu haben,</p>\n<p>euer Beachcup-Team!</p>','',NULL,'','','','','','','','above',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,0,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(115,7,'tl_news',128,1465308772,'text','a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:0:\"\";}','<p>Con il nostro nuovo sito é cambiato anche il processo di iscrizione ai tornei. In questo articolo vogliamo spiegarvi come si fa.</p>\n<p>[nbsp]</p>\n<p>Prima di tutto vogliamo accennare che é possibile <strong>iscriversi sempre solamente a una, la seguente, tappa</strong>.</p>\n<p>[nbsp]</p>\n<h3>Siamo una squadra, come ci iscriviamo?</h3>\n<p>Basta che uno dei due giocatori si registri sul nostro sito ed effettui l\'iscrizione per tutti e due come segue:</p>\n<ol>\n<li><a href=\"{{link_url::66}}\" target=\"_blank\">Registrazione</a> (Non dimenticatevi di cliccare il link di attivazione nella mail che segue all\'inserimento dei vostri dati)</li>\n<li>Login</li>\n<li>Inserisci nel menu[nbsp]\"My Beachcup\"[nbsp]sotto[nbsp]<strong>Fase 1 (I miei giocatori)</strong>[nbsp]i dati dei giocatori</li>\n<li>Crea nel menu[nbsp]\"My Beachcup\" sotto[nbsp]<strong>Fase 2 (Le mie squadre)</strong>[nbsp]la vostra[nbsp]squadra</li>\n<li>Iscriviti nel menu[nbsp]\"My Beachcup\" sotto[nbsp]<strong>Fase 3 (Le mie iscrizioni)</strong>[nbsp]ai tornei della tappa seguente</li>\n</ol>\n<p>In caso il torneo scelto fosse giá esaurito la vostra iscrizione riceverá lo stato <strong>\"torneo esaurito, in lista d\'attesa\"</strong>. Nel caso non fosse giá esaurito riceverá lo stato <strong>\"da verificare\"</strong> e cambierá nello stato <strong>\"confermato\"</strong> dopo risultando conforme al nostro regolamento. Lo stato <strong>\"incompleto\"</strong> verrá assegnato alla vostra iscrizione se mancano certificati medici e/o liberatorie. Le possibilitá su come e soprattutto fino a quando ci dovete[nbsp]consegnare questi documenti le trovate nel <a href=\"{{link_url::45}}\" target=\"_blank\">regolamento</a> sotto \"Iscrizioni\".</p>\n<p>I dati dei giocatori e le formazioni delle squadre rimangono ovviamente salvate da tappa a tappa nella vostra area riservata. É naturalmente possibile inserire dati di piú di due giocatori e di creare piú di una squadra, specialmente quando le formazioni dei team cambiano da tappa a tappa.</p>\n<p>[nbsp]</p>\n<h3>Siamo un gruppo o un\'associazione, come iscrivo i miei giocatori?</h3>\n<p>Anche in questo caso basta che una persona, il responsabile del gruppo, esegui i passi su nominati, cioé inserire tutti i dati dei giocatori, creare[nbsp]le squadre e iscrivere queste[nbsp]a uno o piú tornei.</p>\n<p>Anche qui vale lo stesso come detto prima, cioé che in ogni momento si puó aggiungere nuovi giocatori e creare nuove coppie.</p>\n<p>[nbsp]</p>\n<p>Speriamo che vi siamo stato d\'aiuto con questa breve guida,</p>\n<p>il vostro[nbsp]Beachcup team!</p>','',NULL,'','','','','','','','above',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,0,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(121,13,'tl_news',128,1465813078,'text','a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:0:\"\";}','<p>Liebe Beachvolleyball-Freunde, bis zur nächsten Etappe in Klausen müsst ihr euch noch etwas gedulden. In der Zwischenzeit möchten wir euch vorab schon mal über den Anmeldetermin dafür in Kenntnis setzen:</p>\n<p>Geplante Freischaltung der Anmeldung für Klausen: <strong>Montag, 20. Juni</strong></p>\n<p>Nachdem es der Wunsch vieler ist, sich auch bereits zu allen Folgeetappen anmelden zu können, wollen wir versuchen, dies bis dahin umzusetzen.</p>\n<p>Bis gleich,</p>\n<p>euer Beachcup-OK-Team!</p>','1','S~1K\0\"W-','','','a:3:{i:0;s:3:\"200\";i:1;s:0:\"\";i:2;s:12:\"proportional\";}','a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:2:\"20\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:2:\"px\";}','','','','left',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,0,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(117,8,'tl_news',128,1464969198,'text','a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:0:\"\";}','<p>Die erste Station des Raiffeisen Beachcups heißt auch in diesem Jahr wieder Dorf Tirol.[nbsp] Die lokalen Organisatoren des[nbsp] AS Merano Volley tragen am kommenden Wochenende die erste OPEN-Etappe aus und STS-Volley aus Bozen ist für die erste JUGEND Etappe verantwortlich.</p>\n<p>Am Samstag, 4. Juni beginnt die Beachcup-Saison mit der JUGEND Etappe. Die Altersklassen sind gemäß dem italienischen Kategoriensystem in U18, U16 und U14 bei den Mädchen und in U17, U15 und U13 bei den Jungs eingeteilt. Zahlreiche junge Südtiroler werden ihr Können unter Beweis[nbsp] stellen und sich mit österreichischen Jugendlichen und Kids aus anderen Regionen Italiens messen.</p>\n<p>Am Sonntag, 5. Juni[nbsp] sind dann die Erwachsenen an der Reihe. Das heißt Heimspiel für die amtierenden Landesmeister Kevin Huber und Alexander Somvi aus Dorf Tirol und[nbsp] Götsch/Pixner aus dem Passeiertal. Aber auch andere Teams aus dem Land wollen beim Kampf und die Trophäe ein Wörtchen mitreden. So etwa die Vize-Landesmeister aus Bruneck Gröber/Kargruber oder die Jugend-Auswahlspieler Lukas Ellemunt und Jakob Windisch. Die beiden Sterzinger haben in letzter Zeit mit einigen guten Ergebnissen, zuletzt einem Sieg bei einem C-Cup in Tirol, auf sich aufmerksam gemacht. Und auch bei den Damen sind bereits zahlreiche Teams aus dem Norden Italiens für die Etappe in Dorf Tirol gemeldet. Hier sind wir gespannt, welche neuen Gesichter[nbsp] auf den Plätzen Südtirols zu sehen sind und wer sich in diesem Jahr beim Raiffeisen Beachcup durchsetzen wird.</p>\n<p>Die Anmeldungen für die Etappe in Dorf Tirol sind noch bis Mittwoch möglich. Wer in Dorf Tirol an den Start geht seht ihr auf der <a href=\"de/etappen/stage/14.html\">Etappenseite von Dorf Tirol</a>.</p>\n<p>Dies die Spielpläne für diese Etappe:</p>\n<ul>\n<li>Samstag: <a href=\"{{file::7fb3a974-29a2-11e6-b7eb-002219572d0e}}\" target=\"_blank\">Jugend</a></li>\n<li>Sonntag: <a href=\"{{file::8a267026-29a2-11e6-b7eb-002219572d0e}}\" target=\"_blank\">Open</a></li>\n</ul>\n<p><br><strong>Neue Homepage – Neuer Anmeldeprozess</strong></p>\n<p>Durch den Relaunch der Homepage ist[nbsp] auch das Anmeldeverfahren neu. Nach der Registrierung auf www.beachcup.it kann ein Spieler sein Team zusammenstellen und zu einer Etappe anmelden. So ist es beispielsweise für[nbsp] Trainer einfacher, seine Jugendspieler in einem Schritt anzumelden, nachdem die Spieler einmal eingetragen worden sind.</p>','1','F\'\0\"W-','','','a:3:{i:0;s:3:\"200\";i:1;s:0:\"\";i:2;s:12:\"proportional\";}','a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:2:\"20\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:2:\"px\";}','','','','left',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,0,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(118,9,'tl_news',16,1464969585,'text','a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:0:\"\";}','<p>Sabato, 4 giugno si comincerà con le categorie giovanili, a differenza dell’anno scorso. Per rendere i tornei giovanili uniformi al sistema categorico italiano sono stati suddivisi nelle seguente fasce di età: U18, U16 e U14 nel femminile e U17, U15 e U13 nel maschile. Tanti giovani talenti altoatesini si metteranno alla prova e si misureranno con coetanei provenienti da altre regioni italiane e anche dall’Austria.</p>\n<p>Domenica, 5 giugno poi sarà il turno degli adulti. I campioni provinciali dell’anno scorso Kevin Huber e Alexander Somvi quindi giocheranno in casa, come anche Götsch/Pixner della Val Passiria. Nonostante questo vantaggio, anche altri accoppiamenti dell’Alto Adige vogliono dire la loro in questo torneo, come per esempio i vice campioni provinciali Gröber/Kargruber e anche i giovani Lukas Ellemunt ed il suo compagno Jakob Windisch. Questi ultimi, provenienti da Vipiteno, hanno già fatto vedere di cosa sono capaci, ultimamente con una vittoria di un torneo della categoria “C” in Austria. Anche nel femminile si sono iscritte già numerose coppie del Norditalia per il torneo a Tirolo. Rimane però interessante vedere quali nuovi volti verranno a trovarci sui campi da beach volley altoatesini e a chi andrà questo primo titolo del Raiffeisen Beachcup.</p>\n<p>Iscrizioni ai tornei di Tirolo verranno accettati ancora fino a mercoledì sera. Le squadre partecipanti si possono vedere sul <a href=\"it/tappe/stage/14.html\">sito relativo alla tappa di Tirolo</a>.</p>\n<p>I tabelloni per questa tappa:</p>\n<ul>\n<li>Sabato: <a href=\"{{file::7fb3a974-29a2-11e6-b7eb-002219572d0e}}\">Giovanile</a></li>\n<li>Domenica: <a href=\"{{file::8a267026-29a2-11e6-b7eb-002219572d0e}}\" target=\"_blank\">Open</a></li>\n</ul>\n<p>Il nuovo sito internet comporta inoltre anche un nuovo metodo d’iscrizione. Dopo aver effettuato la registrazione dei singoli pallavolisti, un membro della squadra può effettuare l’iscrizione alla tappa desiderata. Quindi diventa più facile per gli allenatori delle giovanili iscrivere i loro protetti.</p>','1','F\'\0\"W-','','','a:3:{i:0;s:3:\"200\";i:1;s:0:\"\";i:2;s:12:\"proportional\";}','a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:2:\"20\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:2:\"px\";}','','','','left',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,0,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(119,11,'tl_news',32,1465308038,'text','a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:0:\"\";}','<p>Ausgeglichene und freundschaftliche Stimmung herrschte am Sonntag bei der ersten OPEN-Etappe des Raiffeisen Beachcups in Dorf Tirol. Erstmalig waren mehr Damen- als Herrenteams gemeldet, darunter viele Nachwuchsteams, die sich bei den Herren und bei den Damen bis in das Finale vorarbeiteten.<br>Doch zum Schluss siegte die Routine über die jugendliche Leichtigkeit.</p>\n<p>Bei den Herren setzen sich die Lokalmatadoren Alexander Somvi und Kevin Huber gegen das Nachwuchsteam Lukas Ellemunt und Jakob Windisch aus Sterzing durch, nachdem diese das Spiel in der Vorrunde noch klar für sich entscheiden konnten.[nbsp] Mit guten Aufschlägen, vielen Breakpunkten und Unterstützung des heimischen Publikums konnten die zwei erfahrenen Dorf Tiroler die jungen Sterzinger dann aber im Finalevon Beginn an unter Druck setzen. Ellemunt/Windisch fanden so kaum ins Spiel und die amtierenden Landesmeister im Beachvolleyball Somvi/Huber gewinnen klar mit 2:0 (21:14, 21:17). Sie holen sich damit die ersten 100 Punkte für die Gesamtwertung.</p>\n<p>Bei den Damen zeigte sich imFinale ein ähnliches Bild. Die beiden erfahrenen Spielerinnen Roberta Camarda und Pamela Guglielmetti, die schon einige Siege beim Raiffeisen Beachcup auf ihrem Konto haben, standen dem Nachwuchsteam Emma Kudoglu und Francesca Michieletto aus Trient gegenüber. Und auch hier setze sich in einem hart umkämpften Spiel die Routine durch und Camarda/Guglielmetti gewinnen mit 2:0 (21:15, 21:15) die erste Etappe des Raiffeisen Beachcups.</p>\n<p>Die Spiele um[nbsp] Platz drei waren bei den Damen und Herren jeweils in Südtiroler Hand. Bei den Herren gewannen die Altmeister aus dem Passeiertal Filip Götsch und Markus Pixner mit 2:0 (15:9, 17:15) gegen die Vizelandesmeister Markus Gröber und Martin Kargruber. Aurora Bazzanella und Chiara Pedrotti gehen mit 2:0 (15:9, 15:7) als Siegerinnen aus dem Spiel gegen Verena Ganthaler und Sabine Botzner.</p>\n<p>Am Tag zuvor kämpften 36 Burschen- und Mädchenteams in jeweils 3 Kategorien um die Siege der ersten JUGEND Etappe. Spannende Ballwechsel, viel Einsatz und ehrgeizige Spiele wurden den Zuschauern geboten. Zum Schluss waren bei den Burschen alle drei Kategorien fest in der Hand des SSV Bruneck, hingegen bei den Mädchen die Spielerinnen aus Bozen ebenfalls alle Kategorien dominierten.</p>\n<p>Die beiden Veranstalter, der AS Merano Volley und das STS –Sport Team Südtirol schauen auf eine gelungene erste Etappe in Dorf Tirol zurück und wir sind gespannt, was uns beim nächsten Turnierstopp[nbsp] in Klausen erwartet. Hier findet am Samstag,[nbsp] 02.07. die erste FREIZEIT-Etappe statt und am Sonntag, 03.07. eine weitere JUGEND-Etappe.</p>\n<p>Alle Ergebnisse:</p>\n<ul>\n<li><a href=\"{{file::d703049a-2c7c-11e6-b7eb-002219572d0e}}\" target=\"_blank\">Jugend-Turniere</a></li>\n<li><a href=\"{{file::d703047c-2c7c-11e6-b7eb-002219572d0e}}\" target=\"_blank\">Open-Turniere</a></li>\n</ul>','1','\"/,\0\"W-','','','a:3:{i:0;s:3:\"200\";i:1;s:0:\"\";i:2;s:12:\"proportional\";}','a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:2:\"20\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:2:\"px\";}','','1','','left',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,0,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(120,12,'tl_news',32,1465308162,'text','a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:0:\"\";}','<p>Atmosfera calorosa e partite combattute a Tirolo lo scorso finesettimana nella prima tappa OPEN del Raiffeisen Beachcup a Tirolo. Per la prima volta in assoluto c’erano più squadre femminili partecipanti che maschili. Tra di queste anche molte giovani coppie che se la sono giocata alla grande, arrivando anche in finale. Alla fine però è stata l’esperienza a dominare sulla gioventù.</p>\n<p>Nel maschile ha vinto la squadra di casa Alexander Somvi e Kevin Huber, vincendo la finale contro i giovani Lukas Ellemunt e Jakob Windisch che nella stessa sfida nella fase a gironi sono riusciti a dominare chiaramente i Tirolesi. Nella finale però l’accoppiamento di casa ha messo in difficoltà i giovani beacher con battute vincenti, tanti break e il supporto di tutto il pubblico presente dall’inizio. Così Ellemunt/Windisch non sono riusciti ad entrare in partita e i campioni provinciali in carica Somvi/Huber si sono aggiudicati il titolo e i primi 100 punti per la classifica finale in due set (21:14, 21:17).</p>\n<p>Nel femminile si è visto più o meno lo stesso scenario. Le due esperte Roberta Camarda e Pamela Guglielmetti che hanno vinto già tante volte delle tappe OPEN negli anni passati, si sono confrontate con le due giovani trentine Emma Kudoglu e Francsca Michieletto nella finale. Anche qui però l’esperienza ha dominato, in quanto sono uscite vincitrici dalla partite entusiasmante le esperte Camarda/Guglielmetti in due set (21:15, 21:15).</p>\n<p>Le finaline invece se le sono giocate solo coppie altoatesine, sia nel femminile che nel maschile. Filip Götsch e Markus Pixner della Val Passiria hanno avuto la meglio contro i vice campioni provinciali Markus Gröber e Martin Kargruber per 2:0 (15:9, 17:15) e Aurora Bazzanella con Chiara Pedrotti si sono aggiudicate il terzo posto vincendo contro Verena Ganthaler e Sabine Botzner, anche per 2:0 (15:9, 15:7).</p>\n<p>Il giorno prima sono stati giocati sugli stessi campi da beach a Tirolo i primi tornei delle sei categorie giovanili ai quali hanno partecipato ben 36 coppie (femminili e maschili). I giovani beacher hanno mostrato agli spettatori partite mozzafiato, piene di scambi palla entusiasmanti e tanta devozione. In testa a tutte e tre le categorie maschili si sono piazzati accoppiamenti dell’SSV Brunico, le categorie femminili invece sono state dominate dalle bolzanine.</p>\n<p>Gli organizzatori locali dell’AS Merano Volley e l’STS – Sport Team Südtirol di Bolzano possono essere fieri dell’evento e del successo che ha avuto. Ora l’interesse si sposta verso la prossima tappa del Raiffeisen Beachcup a Chiusa dove sabato 2 luglio si terrà la prima tappa AMATORIALE e domenica 3 luglio un’altra tappa GIOVANILE.</p>\n<p>Tutti i risultati:</p>\n<ul>\n<li><a href=\"{{file::d703049a-2c7c-11e6-b7eb-002219572d0e}}\" target=\"_blank\">Tornei giovanile</a></li>\n<li><a href=\"{{file::d703047c-2c7c-11e6-b7eb-002219572d0e}}\" target=\"_blank\">Tornei Open</a></li>\n</ul>','1','\"/,\0\"W-','','','a:3:{i:0;s:3:\"200\";i:1;s:0:\"\";i:2;s:12:\"proportional\";}','a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:2:\"20\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:2:\"px\";}','','1','','left',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,0,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(122,14,'tl_news',128,1465813048,'text','a:2:{s:4:\"unit\";s:2:\"h1\";s:5:\"value\";s:0:\"\";}','<p>Cari amici del beach volley, fino alla prossima tappa a Chiusa dovrete avere ancora un po\' di pazienza. Nel frattempo peró vogliamo cogliere l\'occasione di informarvi giá sulla data d\'iscrizione:</p>\n<p>Data d\'iscrizione per Chiusa in programma: <strong>Lunedì, 20. giugno</strong></p>\n<p>Inoltre, per seguire i vostri suggerimenti, vogliamo cercare di potervi dare la possibilità di iscrivervi anche ai tornei delle tappe seguenti.</p>\n<p>A sentirci presto,</p>\n<p>il vostro Beachcup team!</p>','1','S~1K\0\"W-','','','a:3:{i:0;s:3:\"200\";i:1;s:0:\"\";i:2;s:12:\"proportional\";}','a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:2:\"20\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:2:\"px\";}','','','','left',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,0,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(123,72,'tl_article',128,1465887340,'module','',NULL,'',NULL,'','','','','','','','above',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,40,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default'),(124,73,'tl_article',128,1465887449,'module','',NULL,'',NULL,'','','','','','','','above',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','','',NULL,'','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'',NULL,'','',0,300,0,'',0,0,0,0,41,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','a:2:{i:0;s:0:\