INSERT INTO `tl_news` VALUES (3,3,1462887851,'Back to the Beach','back-to-the-beach',1,1462532040,1462532040,'Beachcup 2016','<p>È tempo di ricominciare la stagione estiva e così il Raiffeisen Beachcup ha determinato le date della sua serie di tornei di beach volley. Gli organizzatori dell’OK si sono dati da fare per sviluppare un sistema categorico che potesse soddisfare maggior parte delle richieste. Inoltre, come vedete, è stato realizzato un nuovo sito internet.</p>','1',' BO杦\0>\0e','','a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}','a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:0:\"\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:0:\"\";}','','','','above','',NULL,'default',0,0,'','','','','','1','',''),(4,2,1462887829,'Es wird wieder gebaggert','es-wird-wieder-gebaggert',1,1462537740,1462537740,'Beachcup 2016','<p>Die Beachvolleyballsaison kann losgehen und dafür wurden auch die Termine der Raiffeisen Beachcup Turnierserie festgelegt. Das OK Team hat sich wieder Mühe gegeben, die Etappen und Kategorien so zu gestalten, dass die Nachfrage möglichst gedeckt wird. Wie ihr seht, wurde zusätzlich an einem neuen Internetauftritt gearbeitet.</p>','1',' BO杦\0>\0e','','a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}','a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:0:\"\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:0:\"\";}','','','','above','',NULL,'default',0,0,'','','','','','1','',''),(6,2,1464015383,'Wie melde ich mich an?','wie-melde-ich-mich-an',1,1464011880,1464011880,'Ein kurzer Leitfaden','<p>Mit unserer neuen Homepage hat sich auch der Anmeldeprozess etwas geändert. In diesem Beitrag sollen euch die nötigen Schritte dazu erklärt werden.</p>','1','UEo^ v\0\"W-','','a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}','a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:0:\"\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:0:\"\";}','','','','above','',NULL,'default',0,0,'','','','','','1','',''),(7,3,1464017808,'Come mi iscrivo?','come-mi-iscrivo',1,1464015600,1464015600,'Una breve guida','<p>Con il nostro nuovo sito é cambiato anche il processo di iscrizione ai tornei. In questo articolo vogliamo spiegarvi come si fa.</p>','1','UEo^ v\0\"W-','','a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}','a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:0:\"\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:0:\"\";}','','','','above','',NULL,'default',0,0,'','','','','','1','',''),(8,2,1464785087,'Auf die Plätze, fertig, los!','auf-die-plaetze-fertig-los',1,1464784620,1464784620,'Traditioneller Start in Dorf Tirol','<p>Die erste Station des Raiffeisen Beachcups heißt auch in diesem Jahr wieder Dorf Tirol.[nbsp] Die lokalen Organisatoren des[nbsp] AS Merano Volley tragen am kommenden Wochenende die erste OPEN-Etappe aus und STS-Volley aus Bozen ist für die erste JUGEND Etappe verantwortlich.</p>','1','F\'\0\"W-','','a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}','a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:0:\"\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:0:\"\";}','','','','above','',NULL,'default',0,0,'','','','','','1','',''),(9,3,1464785859,'Pronti, attenti e via!','pronti-attenti-e-via',1,1464785280,1464785280,'Inizio tradizionale a Tirolo','<p>Come già negli anni passati, la prima tappa del Raiffeisen Beachcup si terrà a Tirolo. I magnifici tre campi da beach volley di Tirolo e i calorosi organizzatori locali dell’AS Merano Volley per l’OPEN e l’STS Volley di Bolzano per il GIOVNAILE, si riconfermano ogni anno per avviare la stagione di beach volley con le prime, entusiasmanti tappe.</p>','1','F\'\0\"W-','','a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}','a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:0:\"\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:0:\"\";}','','','','above','',NULL,'default',0,0,'','','','','','1','',''),(11,2,1465306420,'Ergebnisse Dorf Tirol','ergebnisse-dorf-tirol',1,1465282560,1465282560,'Routiniers an der Spitze','<p>Ausgeglichene und freundschaftliche Stimmung herrschte am Sonntag bei der ersten OPEN-Etappe des Raiffeisen Beachcups in Dorf Tirol. Erstmalig waren mehr Damen- als Herrenteams gemeldet, darunter viele Nachwuchsteams, die sich bei den Herren und bei den Damen bis in das Finale vorarbeiteten.<br>Doch zum Schluss siegte die Routine über die jugendliche Leichtigkeit.</p>','1','\"/,\0\"W-','','a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}','a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:0:\"\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:0:\"\";}','','','','above','',NULL,'default',0,0,'','','','','','1','',''),(12,3,1465306638,'Risultati Tirolo','risultati-tirolo',1,1465282800,1465282800,'In testa noti altoatesini','<p>Atmosfera calorosa e partite combattute a Tirolo lo scorso finesettimana nella prima tappa OPEN del Raiffeisen Beachcup a Tirolo. Per la prima volta in assoluto c’erano più squadre femminili partecipanti che maschili. Tra di queste anche molte giovani coppie che se la sono giocata alla grande, arrivando anche in finale. Alla fine però è stata l’esperienza a dominare sulla gioventù.</p>','1','\"/,\0\"W-','','a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}','a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:0:\"\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:0:\"\";}','','','','above','',NULL,'default',0,0,'','','','','','1','',''),(13,2,1465812208,'Get Ready!','get-ready',1,1465811040,1465811040,'Anmeldetermin für Klausen','<p>Liebe Beachvolleyball-Freunde, bis zur nächsten Etappe in Klausen müsst ihr euch noch etwas gedulden. In der Zwischenzeit möchten wir euch vorab schon mal über den Anmeldetermin dafür in Kenntnis setzen.</p>','1','S~1K\0\"W-','','a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}','a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:0:\"\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:0:\"\";}','','','','above','',NULL,'default',0,0,'','','','','','1','',''),(14,3,1465813114,'Get Ready!','get-ready-14',1,1465812240,1465812240,'Data d\'iscrizione per Chiusa','<p>Cari amici del beach volley, fino alla prossima tappa a Chiusa dovrete avere ancora un po\' di pazienza. Nel frattempo peró vogliamo cogliere l\'occasione di informarvi giá sulla data d\'iscrizione.</p>','1','S~1K\0\"W-','','a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}','a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:0:\"\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:0:\"\";}','','','','above','',NULL,'default',0,0,'','','','','','1','','');
