te velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint obcaecat cupiditat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum. Den Artikel lesen: Es wird wieder gebaggert!, Banner',10.5,'4d12f871f7ac70938b03e2699fc3d723','','0','de'),(9,11,1462960054,'Reglement','index.php/reglement.html','Reglement Reglement 2016 Spielregeln: Beim Raiffeisen Beachcup wird nach den internationalen Beachvolleyball-Regeln der FIVB gespielt. Mehr Informationen dazu finden Sie auf der Homepage der FIVB oder hier: FIVB-Spielregeln auf Deutsch Technische Richtlinien für die Austragung der Beachcup Jugend-Etappen Das OK des Beachcup möchte in Zusammenarbeit mit der FIPAV Bozen einige Grundsätze schaffen um der Jugendförderung im Beachvolleyball in Südtirol gerecht zu werden. Die Richtlinien findet ihr hier: Jugend-Spielregeln Teilnahmeberechtigt: Am „Raiffeisen Beachcup“ können alle Sportler/Innen welche beim Fachsportverband FIPAV tesseriert sind und von ihrem Verein nicht für die Aktivität Beachvolleyball über das Online Portal der FIPAV gesperrt sind, teilnehmen. Jene die nicht über eine Tesserierung beim Fachsportverband FIPAV verfügen, können bei der Einschreibung (Anmeldeformular) eine sogenannte Tagestesserierung „tesseramento per evento“ beantragen, welche vorbehaltlich dessen Annahme zur Teilnahme an den Turnieren berechtigt. Kategorie Open Herren/Damen: Die Teilnahme am Turnier wird nur nach Vorlage eines gültigen ärztlichen Zeugnises (Hausarzt oder Sportarzt) gewährt, welches die uneingeschränkte Eignung für die Ausübung dieser Sportart bescheinigt! Kategorie Freizeit Herren: Es sind alle Sportler teilnahmeberechtigt, welche ein gültiges ärztliches Zeugnis (Hausarzt oder Sportarzt) vorweisen können und in der abgelaufenen Hallen-Saison maximal in der italienischen Serie D und noch nie in der italienischen Serie B2 oder höher gespielt haben. Die selbe Einschränkung wird auf andere Ligen im Ausland angewendet. Zudem sind die Halbfinalisten der Raiffeisen Beachcup Open Etappen der letzten beiden Jahre hier nicht spielberechtigt. Spielberechtigt sind auch Teams, bei denen beide Spieler älter als 40 sind oder ein Spieler jünger als 16 ist. Für Frauen- oder Mixed-Teams gibt es keine getrennte Wertung und keine Begrenzung bezüglich ihres Spielniveaus. Das OK des Beachcups behält sich das Recht vor einzelne Spieler oder Mannschaften aufgrund ihrer Spielstärke die Teilnahme in dieser Kategorie zu erlauben oder zu verwehren. Kategorie Jugend: Es sind alle SportlerInnen teilnahmeberechtigt, welche ein gültiges ärztliches Zeugnis (Hausarzt oder Sportarzt) vorweisen können. Es gelten folgende Altersbeschränkungen: U18 w: geboren nach dem 01.01.1999 U17 m: geboren nach dem 01.01.2000 U16 w: geboren nach dem 01.01.2001 U15 m: geboren nach dem 01.01.2002 U14 w: geboren nach dem 01.01.2003 U13 m: geboren nach dem 01.01.2004 Einschreibungen: Die Anmeldungen können ausschließlich online auf www.beachcup.it bis innerhalb Mittwoch 18:00 Uhr vor der jeweiligen Etappe gemacht werden, solange noch freie Plätze verfügbar sind. Die Einschreibung ist nur gültig, wenn die Eigenerklärung bzw. Datenschutzerklärung sowie das ärztliche Attest ebenfalls innerhalb Mittwoch 18:00 Uhr vor der jeweiligen Etappe entweder an die Faxnummer 0474 05 06 08 oder an info@beachcup.it gesendet wird. Weitere Infos unter Tel. +39 393 7064116 oder per mail: info@beachcup.it Turniermodus: Die Veranstaltung gliedert sich in mehrere Etappen und unterschiedliche Kategorien (Details zu jeder Etappe unter Turniere 2016). Die Turniere finden bei jeder Witterung statt. Spielkategorien: - Open Damen & Herren - Freizeit Herren - Jugend U18 Mädchen & U17 Buben - Jugend U16 Mädchen & U15 Buben - Jugend U14 Mädchen & U13 Buben Es ist aus organisatorischer Sicht nicht möglich, an einem Tag an zwei Bewerben teilzunehmen. Bei den Gruppenspielen wird ein Satz mit mindestens 15 Punkten im Rally-Point System gespielt, wobei ein Mindestvorsprung von 2 Punkten notwendig ist. Die erst- und zweitplatzierte Mannschaft qualifizieren sich für die nächste Runde. Bei den darauf folgenden Spielen wird ein Satz bis 21 Punkten gespielt. Das Finale wird in 2 Gewinnsätzen entschieden (3. Satz bis 15 Punkte). Erscheint eine Mannschaft nicht innerhalb 5 Minuten zu einem Spiel (Zeitplan laut Spielplan), wird das Spiel als verloren gewertet und zwar mit 15:8 bzw. 21:11. Für die U13- und U14-Jugendbewerbe wird in einem Feld von 7 X 14 m gespielt, alle anderen Bewerbe spielen auf einem Spielfeld mit 8 x 16 m. Die Netzhöhen gelten wie folgt: U14w- 2,05m | U13m - 2,05m U16w - 2,20m | U15m - 2,20m U18w/Damen - 2,24m | U17m/Herren - 2,43m Gesamtwertung: Open: Für die Gesamtwertung werden die Punkte der drei Etappen zusammengezählt. Sollten 2 oder mehrere Mannschaften in der Gesamtwertung dieselbe Punktezahl aufweisen, wird das Team besser gewertet, das mehr Teilnahmen am Raiffeisen Beachcup hatte. Bei neuerlichem Gleichstand entscheidet die beste Platzierung in der Turnierserie. Freizeit Herren: Für die Gesamtwertung werden die Punkte der zwei Freizeitturniere und der drei Open-Turniere zusammengezählt, wobei nur die besten vier Etappen gewertet werden. In den Jugend-Kategorien gibt es keine Gesamtwertung. Punktevergabe: 1. Platz - 100 Punkte 2. Platz - 90 Punkte 3. Platz - 80 Punkte 4. Platz - 70 Punkte Verlierer Viertelfinale - 60 Punkte Verlierer Achtelfinale - 50 Punkte Gruppendrittletzter - 40 Punkte Gruppenvorletzter - 30 Punkte Gruppenletzter - 20 Punkte Die Punkte werden pro Mannschaft vergeben. Bei der letzten Etappe wird die doppelte Punktezahl vergeben. (1. Platz - 200 Punkte.; 2. Platz - 180 Punkte; 3. Platz - 160 Punkte; usw.) Nenngebühr*: Die Nenngebühr beinhaltet den Eintritt in die jeweiligen Schwimmbäder (falls vorhanden), sowie einmal für die gesamte Tour ein Spielleibchen des \"Raiffeisen Beachcup\" pro Spieler. \"Bank The Future\" Kunden erhalten eine Ermäßigung von 20%. Jedes weitere Spielleibchen wird vom Veranstalter gegen den Unkostenbeitrag von € 15,00 weitergegeben (Materialkosten und Aufdruck). Kategorie Nenngebühr Erstteilnahme jede weitere Etappe Bank The Future Kunden Open 55 Euro 45 Euro 20% Ermäßigung Freizeit 45 Euro 35 Euro 20% Ermäßigung Jugend 35 Euro 25 Euro 20% Ermäßigung *WICHTIG: für Spieler welche noch nicht beim Fachsportverband „FIPAV“ gemeldet sind und über das Einschreibeformular (Datenschutzerklärung) eine Tagestesserierung „tesseramento per evento“ beantragen fallen zusätzlich 2,00 € pro Etappe an. Erscheint eine Mannschaft nicht zu einer Etappe ohne sich vorher rechtzeitig abzumelden, muss die Einschreibegebühr trotzdem entrichtet werden. Spielbekleidung: Die Spieler müssen immer mit den offiziellen Turnierdressen spielen. Spielball: Der offizielle Spielball des \"Raiffeisen Beachcup\" ist der Mikasa VLS300. Dieser wird für die Spiele vom OK zur Verfügung gestellt. Preisgeld pro Turnier: Kategorie Open Herren & Damen: Erstplatzierte Mannschaft € 100,00 und Sachpreise für die ersten vier Mannschaften Kategorien Freizeit Herren: Sachpreise für die ersten vier Mannschaften. Kategorie Jugend: Sachpreise. Preisgeld Gesamtwertung: Kategorie Open Herren & Damen: Platz 1: 400 € Platz 2: 200 € Platz 3: 100 € Kategorien Freizeit Herren: Sachpreise für die ersten drei Mannschaften. Preisverteilung: Die Preisverteilung findet stets nach Beendigung des Turniers statt. Die ersten vier Mannschaften werden prämiert. Rahmenprogramm: Bei den einzelnen Etappen werden verschiedene Rahmenprogramme geboten. Details dazu findet man unter dem Link des jeweiligen Veranstaltungsortes auf Turniere 2016. Organisation: Der RAIFFEISEN BEACHCUP wird vom SSV Bruneck Amateursportverein - Sektion Volleyball koordiniert und von den jeweiligen lokalen Veranstaltern organisiert. Details dazu findet man unter dem Link des jeweiligen Veranstaltungsortes auf Turniere 2016. Das Organisationskomitee fungiert lediglich als Koordinator der Tour. Die einzelnen Turniere werden selbstständig von den lokalen Organisatoren durchgeführt. Die Teilnahme erfolgt auf eigenes Risiko. Der Korrdinator und die lokalen Veranstalter übernehmen keinerlei Haftung für Unfälle vor, während und nach den Turnieren, auch nicht Dritten gegenüber. Jeder einzelne Spieler trägt die volle persönliche Verantwortung für seinen Gesundheitszustand. Änderungen: Der Veranstalter behält sich die Möglichkeit vor, Programmänderungen durchzuführen. Die Internetseite www.beachcup.it ist die offizielle Informationsquelle der Veranstaltung. Aus diesem Grund sind alle offiziellen Mitteilungen auf dieser Seite zu finden. Beachcup News Es wird wieder gebaggert 06.05.2016 Beachcup 2016 zum Beitrag » Den Artikel lesen: Es wird wieder gebaggert, Banner',21.8,'484cb1d9dbbb7978fe1b75ea90a63705','','0','de'),(85,48,1466075690,'Risultati tappe','it/risultati-tappe.html','Risultati tappe Risultati tappe Tirolo U13 maschile William Oberkofler e Marc De Martin Michael Burgmann e Paul Wierer Michele Poletti e Alessandro Primiceri Alessandro Zago e Matteo Amort Samuel Bazzanella e Samuel Tranne Leo Villgrater e Niklas Moser U14 femminile Anna Checchi e Gaia Riedmüller Letizia Bazzanella e Giada Guerra Joelle Ertl e Greta Taschler Lisia Brillo e Francesca D\'Apice Milly Garoscio e Susanna Schifferegger U15 maschile Peter Seeber e Johannes Gasser Theo Hanni e Simon Schieder Luca Lazzarini e Alberto Moro Markus Aichner e Isaak Seeber U16 femminile Anika Bachmann e Nora Gasser Joséphine Sacchetto e Giulia Montali Nicole Ianeselli e Elisa Lorenzi Marion Kritzinger e Giulia Garbin Camila Maria Perez Caride e Camilla Tamanini U17 maschile Peter Huber e Maximilian Balzarini Michele Zago e Leonardo Marotta Manuel Ploner e Janpaul Pescollderungg U18 femminile Stefanie Plattner e Katrin Debelyak Bianca Murer e Johanna Micheletti Magdalena Marcher e Anna Berger Laura Bacher e Nadine Gementi Giada Checchi e Nadine Frasnelli Cinthia Sieder e Melania Murro Martina Ploner e Katharina Castlunger Clara D\'Elia e Elisa Tomedi Lara Pöhl e Sandra 