partecipazione: Al Raiffeisen Beachcup possono partecipare tutti gli atleti tesserati FIPAV e dei quali la società di appartenenza non ha dato il divieto per l\'attività di beach volley tramite il portale FIPAV online. Tutti i non tesserati presso la Federazione Italiana Pallavolo FIPAV possono richiedere tramite il modulo di iscrizione (liberatoria) un \"tesseramento per singola manifestazione amatoriale\" quale salvo accettazione autorizza alla partecipazione al singolo torneo/tappa. Categoria \"OPEN\" M/F: La partecipazione al torneo è consentita solo presentando un certificato medico valido (medico sportivo) che certifica l\'idoneità illimitata per lo sport praticato. Categoria \"AMATORIALE Uomini“: Possono partecipare tutti gli atleti in possesso di un certificato medico valido (medico di fiducia o medico sportivo) che certifica l\'idoneità illimitata per lo sport praticato e che nella stagione invernale hanno al massimo giocato nel campionato italiano di Serie D e che in carriera non hanno mai giocato nel campionato italiano di Serie B2 o superiore. Questo vale anche per tutti i campionati paragonabili di un\'altro paese. Anche i giocatori semifinalisti della categoria Open delle utlime due edizioni del Raiffeisen Beachcup sono esclusi. Il comitato organizzatore si riserva di escludere anche singoli giocatori o squadre ritenute di alto livello. Per le coppie mixed non c\'è una classifica separata e nessuna limitazione riguardante il loro livello di gioco. Categoria \"AMATORIALE Donne“: Possono partecipare tutte le atlete in possesso di un certificato medico valido (medico di fiducia o medico sportivo) che certifica l\'idoneità illimitata per lo sport praticato e che nella stagione invernale hanno al massimo giocato nel campionato italiano \"1a Divisione\" e che in carriera non hanno mai giocato nel campionato italiano di Serie C o superiore. Questo vale anche per tutti i campionati paragonabili di un\'altro paese. Anche le giocatrici semifinaliste della categoria Open donne delle utlime due edizioni del Raiffeisen Beachcup sono escluse. Il comitato organizzatore si riserva di escludere anche singole giocatrici o squadre ritenute di alto livello. Categoria giovanile U18, U16 e U14: Tutti i giovani devono presentare un certificato medico valido (medico di fiducia o medico sportivo) che certifica l\'idoneità illimitata per lo sport praticato. Si gioca nelle seguenti categorie: U18 maschile e femminile: nati dopo il 01.01.1998 U16 maschile e femminile: nati dopo il 01.01.2000 U14 maschile e femminile: nati dopo il 01.01.2002 Iscrizioni: L\'iscrizione può essere fatta soltanto online sul sito www.beachcup.it entro le ore 18:00 del mercoledì precedente ad ogni singola tappa e fino all\' esaurimento dei posti liberi. L\'iscrizione è valida solo se entro le ore 18:00 del mercoledì precedente alla prima tappa di partecipazione del atleta la liberatoria e il certificato medico sono stati mandati al numero fax 0474 05 06 08 o a info@beachcup.it. Informazioni: Tel. +39 393 7064116 o via email: info@beachcup.it Modalità del torneo: L\'evento è composto da più tappe e diverse categorie. (Dettagli sulle singole tappe vedasi sotto Tornei 2015). Categorie: - Open femminile e maschile - Amatoriale maschile e femminile - Under 18 femminile e maschile - Under 16 femminile e maschile - Under 14 femminile e maschile Non è possibile iscriversi a piu di una categoria in una giornata. Nella fase di qualificazione (giochi di gruppo) si gioca un set fino ad un mimimo di 15 punti (Rally-Point System). Per la vittoria è necessario avere due punti di vantaggio. Le prime due squadre di ogni gruppo si qualificano per il turno successivo. Dagli ottavi si gioca un set fino a 21 punti. La finale verrà decisa in due set vincenti (3. Set fino a 15 punti). Se una squarda dopo l\'annuncio della partita (previsto dal tabellone) non si presenta entro cinque minuti sul campo da gioco, la partita sarà persa col punteggio di 15:8 o 21:11. Il campo da gioco per la categoria U14 sara ridotto su 7 x 14 m, tutte le altre categorie si giocano sul campo 8 x 16 m. Per l\'altezza rete vale: Feminile: U14w - 2.05 m Maschile: U14m - 2,15 m U16w- 2,15 mU16m- 2,35 m U18/Donne - 2,24 mu18/Uomini - 2,43 m Classifica finale: Open: La somma dei punti di ogni tappa della squadra partecipante dà il risultato finale. Nel caso in cui 2 o più squadre abbiano lo stesso punteggio nella classifica finale, decide il maggior numero di partecipazioni al Raiffeisen Beachcup. In caso di parità viene presa in considerazione il miglior piazzamento. Amatoriale maschile: Le tre tappe della categoria \"Amatoriale\" e le tre tappe \"Open\" valgono per la classifica finale amatoriale però nella classifica finale contano solo i quattro piazzamenti migliori (punteggio!!!). Per la paritá punti conta come descritto per l\'OPEN. Amatoriale donne: Le due tappe della categoria \"Amatoriale\" e le tre tappe \"Open\" valgono per la classifica finale amatoriale però nella classifica finale contano solo i quattro piazzamenti migliori (punteggio!!!). Per la paritá punti conta come descritto per l\'OPEN. Giovanile: Non è previsto una classifica finale. Punti: I punti vanno aggiudicati a squarda. 1° posto - 100 punti 2° posto - 90 punti 3° posto - 80 punti 4° posto - 70 punti squadra perdente ai quarti - 60 punti squadra perdente agli ottavi - 50 punti terzultima classificata nel gruppo - 40 punti penultima classificata nel gruppo - 30 punti ultima classificata nel gruppo - 20 punti I punti verranno aggiudicati a squadra. L\'ultima tappa dà il doppio dei punti. (1° posto - 200 punti; 2° posto - 180 punti; 3° posto - 160 punti; ecc.) Quota d\'iscrizione: Nella quota d\'iscrizione è inclusa l\'entrata nella rispettiva piscina (se disponibile) e inoltre una maglietta del \"Raiffeisen Beachcup\" per giocatore per tutte le tappe. I clienti \"Bank The Future\" hanno diritto ad uno sconto del 20%. Per ogni ulteriore maglietta verranno richieste le spese d\'acquisto di € 15,00 (materiale e stampa). Categoria prima tappa partecipata tappe successive clienti \"Bank The Future\" Open 50 Euro 40 Euro 20% di sconto Amatoriale 40 Euro 30 Euro 20% di sconto Giovanile 30 Euro 20 Euro 20% di sconto Importante: Per partecipanti che non sono regolarmente tesserati presso la Federazione Italiana Pallavolo FIPAV e che tramite modulo di iscrizione (liberatoria) richiedono un \"tesseramento per songola manifestazione amatoriale\" sono tenuti a corrispondere ulteriori 2,00€ per tappa/torneo. Se una squadra non si presenta ad una tappa senza aver tempestivamente disdetto, deve pagare ugualmente la quota d\'iscrizione. Vestiario: I giocatori sono obbligati ad usare sempre la maglietta ufficiale del torneo durante le partite. Pallone di gioco: Il pallone ufficiale del \"Raiffeisen Beachcup\" è il Mikasa VLS300. Il pallone per le partite viene fornito dall\'O.K.. Montepremi: Montepremio per ogni singola tappa: Categoria Open maschile: 1a squadra classificata € 160,00, 2a squadra classificata € 120,00, 3a squadra classificata € 80,00 Categoria Open femminile: 1a squadra classificata € 120,00, 2a squadra classificata € 80,00, 3a squadra classificata € 40,00 Categoria amatoriale: Premi vari. Categoria giovanile: Premi vari. Per la classifica finale valgono gli stessi montepremi previsti per una singola tappa. Premiazione: La premiazione avverrà direttamente dopo ogni torneo. Programma: Durante tutte le tappe vengono offerti dei programmi speciali. Per informazioni dettagliate vedere la pagina dell\' organizzatore locale seguendo l\'apposito link sotto Tornei 2015. Organizzazione: Il \"Raiffeisen Beachcup\" viene coordinato dalla società SSV Bruneck ASV sezione pallavolo e organizzato dai vari organizzatori locali. Per informazioni dettagliate vedere la pagina dell\' organizzatore locale seguendo l\'apposito link sotto Tornei 2015. Il comitato organizzativo funge solo come coordinatore del tour. Alle singole tappe provvedono gli organizzatori locali. La partecipazione è a proprio rischio. Il corrdinatore e gli organizzatori respingono ogni responsabilità per infortuni prima, durante e dopo i tornei, neanche contro terzi. Ogni atleta è responsabile personalmente per la propria salute. Modifiche: In caso di necessità il comitato organizzativo può modificare il regolamento in ogni momento per garantire un buon funzionamento del torneo. Il sito internet www.beachcup.it è l\'ufficale fonte di informazione della manifestazione. Per questa ragione tutte le comunicazioni saranno publicate su quel sito. Beachcup News Viene dragato Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet. Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet. Leggi l\'articolo: Viene dragato, Banner',20.03,'6de2e7e0044ec853714a5937cd3d6abe','','0','it'),(43,48,1461334115,'Partite','it/partite.html','Partite Partite Tirolo U15 maschile Jakob Pallhuber e Greta Pallhuber Punti: 8 Open maschile Jakob Pallhuber e Greta Pallhuber Punti: 4 Jakob Pallhuber e Greta Pallhuber Punti: 1 Brunico - Finale Open Open femminile Peter Noname e Isolde Wagner Punti: 12 Jakob Pallhuber e Greta Pallhuber Punti: 11 Jakob Pallhuber e Peter Noname Punti: 8 Greta Pallhuber e Isolde Wagner Punti: 7 Jakob Pallhuber e Greta Pallhuber Punti: 3 Jakob Pallhuber e Greta Pallhuber Punti: 2 Peter Noname e Isolde Wagner Punti: 1 Beachcup News Viene dragato Sottotitolo Leggi l\'articolo: Viene dragato, Banner',9.78,'f1e84abdc2421816852064de6f546a17','','0','it'),(44,49,1460805328,'Classifiche','index.php/it/classifiche.