ber Unterüberschrift Test Test Test Test Test Test Test Test Test Beachcup News Letzer Test 06.05.2016 Unterüberschrift zum Beitrag » Den Artikel lesen: Letzer Test, Banner',11.04,'a37344f0fc796173cba918ef269e75b0','','0','de'),(71,8,1471078055,'Home','de/home.html','Home Get Ready! Anmeldetermin für Klausen 2016-06-13 Liebe Beachvolleyball-Freunde, bis zur nächsten Etappe in Klausen müsst ihr euch noch etwas gedulden. In der Zwischenzeit möchten wir euch vorab schon mal über den Anmeldetermin dafür in Kenntnis setzen. zum Beitrag » Ergebnisse Dorf Tirol Routiniers an der Spitze 2016-06-07 Ausgeglichene und freundschaftliche Stimmung herrschte am Sonntag bei der ersten OPEN-Etappe des Raiffeisen Beachcups in Dorf Tirol. Erstmalig waren mehr Damen- als Herrenteams gemeldet, darunter viele Nachwuchsteams, die sich bei den Herren und bei den Damen bis in das Finale vorarbeiteten. Doch zum Schluss siegte die Routine über die jugendliche Leichtigkeit. zum Beitrag » Auf die Plätze, fertig, los! Traditioneller Start in Dorf Tirol 2016-06-01 Die erste Station des Raiffeisen Beachcups heißt auch in diesem Jahr wieder Dorf Tirol. Die lokalen Organisatoren des AS Merano Volley tragen am kommenden Wochenende die erste OPEN-Etappe aus und STS-Volley aus Bozen ist für die erste JUGEND Etappe verantwortlich. zum Beitrag » Wie melde ich mich an? Ein kurzer Leitfaden 2016-05-23 Mit unserer neuen Homepage hat sich auch der Anmeldeprozess etwas geändert. In diesem Beitrag sollen euch die nötigen Schritte dazu erklärt werden. zum Beitrag » Es wird wieder gebaggert Beachcup 2016 2016-05-06 Die Beachvolleyballsaison kann losgehen und dafür wurden auch die Termine der Raiffeisen Beachcup Turnierserie festgelegt. Das OK Team hat sich wieder Mühe gegeben, die Etappen und Kategorien so zu gestalten, dass die Nachfrage möglichst gedeckt wird. Wie ihr seht, wurde zusätzlich an einem neuen Internetauftritt gearbeitet. zum Beitrag » Beachcup News Get Ready! 2016-06-13 Anmeldetermin für Klausen zum Beitrag » Ergebnisse Dorf Tirol 2016-06-07 Routiniers an der Spitze zum Beitrag » Auf die Plätze, fertig, los! 2016-06-01 Traditioneller Start in Dorf Tirol zum Beitrag » Wie melde ich mich an? 2016-05-23 Ein kurzer Leitfaden zum Beitrag » Es wird wieder gebaggert 2016-05-06 Beachcup 2016 zum Beitrag » Den Artikel lesen: Get Ready!, Den Artikel lesen: Ergebnisse Dorf Tirol, Den Artikel lesen: Auf die Plätze, fertig, los!, Den Artikel lesen: Wie melde ich mich an?, Den Artikel lesen: Es wird wieder gebaggert, Banner',32.67,'18f72b445c07ffe6b7d330ebd38bbc2f','','0','de'),(56,14,1462468194,'Spielergebnisse','de/spielergebnisse.html','Spielergebnisse Spielergebnisse Beachcup News Letzer Test Unterüberschrift zum Beitrag » Test Unterüberschrift zum Beitrag » Es wird wieder gebaggert! Under construction zum Beitrag » Den Artikel lesen: Letzer Test, Den Artikel lesen: Test, Den Artikel lesen: Es wird wieder gebaggert!, Banner',11.03,'9569da92708793ef6eff58ae4d801588','','0','de'),(80,14,1471078015,'Etappenstände','de/etappenstaende.html','Etappenstände Etappenstände Dorf Tirol U13 männlich William Oberkofler und Marc De Martin Michael Burgmann und Paul Wierer Michele Poletti und Alessandro Primiceri Alessandro Zago und Matteo Amort Samuel Bazzanella und Samuel Tranne Leo Villgrater und Niklas Moser U14 weiblich Anna Checchi und Gaia Riedmüller Letizia Bazzanella und Giada Guerra Joelle Ertl und Greta Taschler Lisia Brillo und Francesca D\'Apice Milly Garoscio und Susanna Schifferegger U15 männlich Peter Seeber und Johannes Gasser Theo Hanni und Simon Schieder Alberto Moro und Luca Lazzarini Markus Aichner und Isaak Seeber U16 weiblich Anika Bachmann und Nora Gasser Joséphine Sacchetto und Giulia Montali Elisa Lorenzi und Nicole Ianeselli Giulia Garbin und Marion Kritzinger Camila Maria Perez Caride und Camilla Tamanini U17 männlich Peter Huber und Maximilian Balzarini Michele Zago und Leonardo Marotta Manuel Ploner und Janpaul Pescollderungg U18 weiblich Stefanie Plattn