nifestazione Piscina scoperta Brunico L\'impianto di beachvolley, che si trova presso la piscina all\'aperto di Brunico, è uno dei più belli della nostra provincia. I due campi interni risanati nel 2012 si mostrano in condizioni ottime e sono preparati con la stessa sabbia usata al torneo di coppa del mondo di Klagenfurt. Al esterno della piscina ci si trovano altri due impianti dove si può praticare il beachvolley per tutto l\'estate. Indirizzo: Via Neurauth 139031 Brunico Organizzatore SSV Bruneck - Sezione Pallavolo Klaus Seeber info@beachcup.it +39 0474 050608 +39 393 7064116 Beachcup News Get Ready! 13.06.2016 Data d\'iscrizione per Chiusa mostra articolo » Risultati Tirolo 07.06.2016 In testa noti altoatesini mostra articolo » Pronti, attenti e via! 01.06.2016 Inizio tradizionale a Tirolo mostra articolo » Come mi iscrivo? 23.05.2016 Una breve guida mostra articolo » Back to the Beach 06.05.2016 Beachcup 2016 mostra articolo » Leggi l\'articolo: Get Ready!, Leggi l\'articolo: Risultati Tirolo, Leggi l\'articolo: Pronti, attenti e via!, Leggi l\'articolo: Come mi iscrivo?, Leggi l\'articolo: Back to the Beach, Banner',14.47,'6335fc93dab786926e69318ce936b8ae','','0','it'),(72,10,1465918217,'Etappen','de/etappen/stage/16.html','Etappen Etappen San Ciascian - Alta Badia 9. bis 10. Juli 2016 Turniere und angemeldete Teams Open Herren (9. Juli 2016) Open Damen (10. Juli 2016) Veranstaltungsort San Ciascian - Alta Badia Die Beachvolleyballanlage in San Ciascian (Gemeinde Abtei) ist eine der höstgelegenen in Südtirol. Gebaggert und gepritscht wird auf 1600 m Mehreshöhe in der imposanten Dolomitenbergkulisse am Fuße des Lavarella und Conturines. Adresse: Sportzone San Ciascian/Alta Badia, Str. Plan 5939030 San Ciascian/Alta Badia Organisator Uniun Sport Amatorial La Ila Giorgio De Grandi uslaila@hotmail.it +39 347 0842309 Beachcup News Get Ready! 13.06.2016 Anmeldetermin für Klausen zum Beitrag » Ergebnisse Dorf Tirol 07.06.2016 Routiniers an der Spitze zum Beitrag » A