 Beachcup News Get Ready! 13.06.2016 Data d\'iscrizione per Chiusa mostra articolo » Risultati Tirolo 07.06.2016 In testa noti altoatesini mostra articolo » Pronti, attenti e via! 01.06.2016 Inizio tradizionale a Tirolo mostra articolo » Come mi iscrivo? 23.05.2016 Una breve guida mostra articolo » Back to the Beach 06.05.2016 Beachcup 2016 mostra articolo » Leggi l\'articolo: Get Ready!, Leggi l\'articolo: Risultati Tirolo, Leggi l\'articolo: Pronti, attenti e via!, Leggi l\'articolo: Come mi iscrivo?, Leggi l\'articolo: Back to the Beach, Banner',13.68,'9041ec7c7a7ec55dc0245cad831830f5','','0','it'),(59,11,1466224463,'Reglement','de/reglement.html','Reglement Reglement 2016 Spielregeln: Beim Raiffeisen Beachcup wird nach den internationalen Beachvolleyball-Regeln der FIVB gespielt. Mehr Informationen dazu finden Sie auf der Homepage der FIVB oder hier: FIVB-Spielregeln auf Deutsch Technische Richtlinien für die Austragung der Beachcup Jugend-Etappen Das OK des Beachcup möchte in Zusammenarbeit mit der FIPAV Bozen einige Grundsätze schaffen um der Jugendförderung im Beachvolleyball in Südtirol gerecht zu werden. Die Richtlinien findet ihr hier: Jugend-Spielregeln Teilnahmeberechtigt: Am „Raiffeisen Beachcup“ können alle Sportler/Innen welche beim Fachsportverband FIPAV tesseriert sind und von ihrem Verein nicht für die Aktivität Beachvolleyball über das Online Portal der FIPAV gesperrt sind, teilnehmen. Jene die nicht über eine Tesserierung beim Fachsportverband FIPAV verfügen, können bei der Einschreibung (Anmeldeformular) eine sogenannte Tagestesserierung „tesseramento per evento“ beantragen, welche vorbehaltlich dessen Annahme zur Teilnahme an den Turnieren berechtigt. Kategorie Open Herren/Damen: Die Teilnahme am Turnier wird nur nach Vorlage eines gültigen ärztlichen Zeugnises (Hausarzt oder Sportarzt) gewährt, welches die uneingeschränkte Eignung für die Ausübung dieser Sportart bescheinigt! Kategorie Freizeit Herren: Es sind alle Sportler teilnahmeberechtigt, welche ein gültiges ärztliches Zeugnis (Hausarzt oder Sportarzt) vorweisen können und in der abgelaufenen Hallen-Saison maximal in der italienischen Serie D und noch nie in der italienischen Serie B2 oder höher gespielt haben. Die selbe Einschränkung wird auf andere Ligen im Ausland angewendet. Zudem sind die Halbfinalisten der Raiffeisen Beachcup Open Etappen der letzten beiden Jahre hier nicht spielberechtigt. Spielberechtigt sind auch Teams, bei denen beide Spieler älter als 40 sind oder ein Spieler jünger als 16 ist. Für Frauen- oder Mixed-Teams gibt es keine getrennte Wertung und keine Begrenzung bezüglich ihres Spielniveaus. Das OK des Beachcups behält sich das Recht vor einzelne Spieler oder Mannschaften aufgrund ihrer Spielstärke die Teilnahme in dieser Kategorie zu erlauben oder zu verwehren. Kategorie Jugend: Es sind alle SportlerInnen teilnahmeberechtigt, welche ein gültiges ärztliches Zeugnis (Hausarzt oder Sportarzt) vorweisen können. Es gelten folgende Altersbeschränkungen: U18 w: geboren nach dem 01.01.1999 U17 m: geboren nach dem 01.01.2000 U16 w: geboren nach dem 01.01.2001 U15 m: geboren nach dem 01.01.2002 U14 w: geboren nach dem 01.01.2003 U13 m: geboren nach dem 01.01.2004 Einschreibungen: Die Anmeldungen können ausschließlich online auf www.beachcup.it bis innerhalb Mittwoch 18:00 Uhr vor der jeweiligen Etappe gemacht werden, solange noch freie Plätze verfügbar sind. Die Einschreibung ist nur gültig, wenn die Eigenerklärung bzw. Datenschutzerklärung sowie das ärztliche Attest ebenfalls innerhalb Mittwoch 18:00 Uhr vor der jeweiligen Etappe entweder an die Faxnummer 0474 05 06 08 oder an info@beachcup.it gesendet wird. Weitere Infos unter Tel. +39 393 7064116 oder per mail: info@beachcup.it Turniermodus: Die Veranstaltung gliedert sich in mehrere Etappen und unterschiedliche Kategorien (Details zu jeder Etappe unter Turniere 2016). Die Turniere finden bei jeder Witterung statt. Spielkategorien: - Open Damen & Herren - Freizeit Herren - Jugend U18 Mädchen & U17 Buben - Jugend U16 Mädchen & U15 Buben - Jugend U14 Mädchen & U13 Buben Es ist aus organisatorischer Sicht nicht möglich, an einem Tag an zwei Bewerben teilzunehmen. Bei den Gruppenspielen wird ein Satz mit mindestens 15 Punkten im Rally-Point System gespielt, wobei ein Mindestvorsprung von 2 Punkten notwendig ist. Die erst- und zweitplatzierte Mannschaft qualifizieren sich für die nächste Runde. Bei den darauf folgenden Spielen wird ein Satz bis 21 Punkten gespielt. Das Finale wird in 2 Gewinnsätzen entschieden (3. Satz bis 15 Punkte). Erscheint eine Mannschaft nicht innerhalb 5 Minuten zu einem Spiel (Zeitplan laut Spielplan), wird das Spiel als verloren gewertet und zwar mit 15:8 bzw. 21:11. Für die U13- und U14-Jugendbewerbe wird in einem Feld von 7 X 14 m gespielt, alle anderen Bewerbe spielen auf einem Spielfeld mit 8 x 16 m. Die Netzhöhen gelten wie folgt: U14w- 2,05m | U13m - 2,05m U16w - 2,20m | U15m - 2,20m U18w/Damen - 2,24m | U17m/Herren - 2,43m Gesamtwertung: Open: Für die Gesamtwertung werden die Punkte der drei Etappen zusammengezählt. Sollten 2 oder mehrere Mannschaften in der Gesamtwertung dieselbe Punktezahl aufweisen, wird das Team besser gewertet, das mehr Teilnahmen am Raiffeisen Beachcup hatte. Bei neuerlichem Gleichstand entscheidet die beste Platzierung in der Turnierserie. Freizeit Herren: Für die Gesamtwertung werden die Punkte der zwei Freizeitturniere und der drei Open-Turniere zusammengezählt, wobei nur die besten vier Etappen gewertet werden. In den Jugend-Kategorien gibt es keine Gesamtwertung. Punktevergabe: 1. Platz - 100 Punkte 2. Platz - 90 Punkte 3. Platz - 80 Punkte 4. Platz - 70 Punkte Verlierer Viertelfinale - 60 Punkte Verlierer Achtelfinale - 50 Punkte Gruppendrittletzter - 40 Punkte Gruppenvorletzter - 30 Punkte Gruppenletzter - 20 Punkte Die Punkte werden pro Mannschaft vergeben. Bei der letzten Etappe wird die doppelte Punktezahl vergeben. (1. Platz - 200 Punkte.; 2. Platz - 180 Punkte; 3. Platz - 160 Punkte; usw.) Nenngebühr*: Die Nenngebühr beinhaltet den Eintritt in die jeweiligen Schwimmbäder (falls vorhanden), sowie einmal für die gesamte Tour ein Spielleibchen des \"Raiffeisen Beachcup\" pro Spieler. \"Bank The Future\" Kunden erhalten eine Ermäßigung von 20%. Jedes weitere Spielleibchen wird vom Veranstalter gegen den Unkostenbeitrag von € 15,00 weitergegeben (Materialkosten und Aufdruck). Kategorie Nenngebühr Erstteilnahme jede weitere Etappe Bank The Future Kunden Open 55 Euro 45 Euro 20% Ermäßigung Freizeit 45 Euro 35 Euro 20% Ermäßigung Jugend 35 Euro 25 Euro 20% Ermäßigung *WICHTIG: für Spieler welche noch nicht beim Fachsportverband „FIPAV“ gemeldet sind und über das Einschreibeformular (Datenschutzerklärung) eine Tagestesserierung „tesseramento per evento“ beantragen fallen zusätzlich 2,00 € pro Etappe an. Erscheint eine Mannschaft nicht zu einer Etappe ohne sich vorher rechtzeitig abzumelden, muss die Einschreibegebühr trotzdem entrichtet werden. Spielbekleidung: Die Spieler müssen immer mit den offiziellen Turnierdressen spielen. Spielball: Der offizielle Spielball des \"Raiffeisen Beachcup\" ist der Mikasa VLS300. Dieser wird für die Spiele vom OK zur Verfügung gestellt. Preisgeld pro Turnier: Kategorie Open Herren & Damen: Erstplatzierte Mannschaft € 100,00 und Sachpreise für die ersten vier Mannschaften Kategorien Freizeit Herren: Sachpreise für die ersten vier Mannschaften. Kategorie Jugend: Sachpreise. Preisgeld Gesamtwertung: Kategorie Open Herren & Damen: Platz 1: 400 € Platz 2: 200 € Platz 3: 100 € Kategorien Freizeit Herren: Sachpreise für die ersten drei Mannschaften. Preisverteilung: Die Preisverteilung findet stets nach Beendigung des Turniers statt. Die ersten vier Mannschaften werden prämiert. Rahmenprogramm: Bei den einzelnen Etappen werden verschiedene Rahmenprogramme geboten. Details dazu findet man unter dem Link des jeweiligen Veranstaltungsortes auf Turniere 2016. Organisation: Der RAIFFEISEN BEACHCUP wird vom SSV Bruneck Amateursportverein - Sektion Volleyball koordiniert und von den jeweiligen lokalen Veranstaltern organisiert. Details dazu findet man unter dem Link des jeweiligen Veranstaltungsortes auf Turniere 2016. Das Organisationskomitee fungiert lediglich als Koordinator der Tour. Die einzelnen Turniere werden selbstständig von den lokalen Organisatoren durchgeführt. Die Teilnahme erfolgt auf eigenes Risiko. Der Korrdinator und die lokalen Veranstalter übernehmen keinerlei Haftung für Unfälle vor, während und nach den Turnieren, auch nicht Dritten gegenüber. Jeder einzelne Spieler trägt die volle persönliche Verantwortung für seinen Gesundheitszustand. Änderungen: Der Veranstalter behält sich die Möglichkeit vor, Programmänderungen durchzuführen. Die Internetseite www.beachcup.it ist die offizielle Informationsquelle der Veranstaltung. Aus diesem Grund sind alle offiziellen Mitteilungen auf dieser Seite zu finden. Beachcup News Get Ready! 13.06.2016 Anmeldetermin für Klausen zum Beitrag » Ergebnisse Dorf Tirol 07.06.2016 Routiniers an der Spitze zum Beitrag » Auf die Plätze, fertig, los! 01.06.2016 Traditioneller Start in Dorf Tirol zum Beitrag » Wie melde ich mich an? 23.05.2016 Ein kurzer Leitfaden zum Beitrag » Es wird wieder gebaggert 06.05.2016 Beachcup 2016 zum Beitrag » Den Artikel lesen: Get Ready!, Den Artikel lesen: Ergebnisse Dorf Tirol, Den Artikel lesen: Auf die Plätze, fertig, los!, Den Artikel lesen: Wie melde ich mich an?, Den Artikel lesen: Es wird wieder gebaggert, Banner',24.07,'81026052ee085943f5718850e84d2015','','0','de'),(83,15,1471078034,'Gesamtstand','de/gesamtstand.html','Gesamtstand Gesamtstand Freizeit Herren ',16.59,'2094078df79e7b9d15a281892efb9157','','0','de'),(81,23,1462886474,'Es wird wieder gebaggert','de/nachrichten/news-eintrag-1.html','Es wird wieder gebaggert Die Beachvolleyballsaison kann losgehen und dafür wurden auch die Termine der Raiffeisen Beachcup Turnierserie festgelegt. Das OK Team hat sich wieder Mühe gegeben, die Etappen und … Es wird wieder gebaggert 2016-05-06 14:29 von Redaktion Start in die neue Beach-Volley-Saison Die Beachvolleyballsaison kann losgehen und dafür wurden auch die Termine der Raiffeisen Beachcup Turnierserie festgelegt. Das OK Team hat sich wieder Mühe gegeben, die Etappen und Kategorien so zu gestalten, dass die Nachfrage möglichst gedeckt wird. Wie ihr seht, wurde zusätzlich an einem neuen Internetauftritt gearbeitet. Die Raiffeisen Beachvolleyballturniere sind für jegliche Altersklassen und Levels, sodass sich auch jeder auf dem Sand der vielen Beachvolleyballplätze in Südtirol messen kann. Wie schon in den letzten Jahren gibt es wieder die Kategorie OPEN, sowohl für Damen, als auch für Herren, an der Spieler jedes Niveaus teilnehmen können. Jedes Jahr verstärkt sich das Teilnehmerfeld durch erfogreiche Volleyballspieler, die aus den verschiedensten Ecken Italiens, Deutschlands und Österreichs anreisen. Eine herausfordernde Etappe wird die OPEN in St. Kassian sein, wo man bisher nur Freizeitetappen veranstaltet hat. Auf 1.500 Metern Höhe kann mit starken Gegnern die Luft schon mal dünn werden. Zusätzlich gibt es wieder die Freizeit Etappen für Männer, an denen nur Beachvolleyballer bis zu einem gewissen Niveau teilnehmen dürfen. Genauere Details dazu findet ihr im Reglement. Zusätzlich zu der üblichen Freizeitetappe in Sterzing kommt dieses Jahr ein neuer Austragungsort dazu, und zwar Klausen. Tramin hingegen wird neuer Austragungsort für eine Etappe der jugendlichen Kategorien sein, bei der man jedes Jahr eine konstante Steigerung der Teilnehmerzahlen erfährt. Dieses Jahr wurde das Turnierangebot an das italienische Kategoriensystem angepasst und somit gibt es die U13, U15 und U17-Turniere für die Jungs und U14, U16 und U18- Turniere für die Mädchen. Die VSS Landesmeisterschaften für Erwachsene und Jugendliche werden auch dieses Jahr als ein eigenes Turnier ausgetragen, das wieder in Bruneck, unter der Schirmherrschaft des VSS, am 13. und 14. August, stattfinden wird. Die Anmeldung zur ersten Etappe in Dorf Tirol wird zwei Wochen vor Etappenstart freigegeben. Das OK-Team und alle Mitveranstalter des jeweiligen Ortes freuen sich wieder die erfolgreiche Raiffeisen Beachcup Serie zu ermöglichen und hoffen auf zahlreiche Anmeldungen, spannende Spiele und natürlich auf viel Spaß in einem freundschaftlichen Umfeld unter strahlenden Sonnenschein. Beachcup News Es wird wieder gebaggert 06.05.2016 Start in die neue Beach-Volley-Saison zum Beitrag » , Den Artikel lesen: Es wird wieder gebaggert, Banner',13.57,'c53f63ae827b7e48ee67f1c7c1bc6caa','','0','de'),(60,15,1462468199,'Ranking','de/ranking.html','Ranking Ranking Beachcup News Letzer Test Unterüberschrift zum Beitrag » Test Unterüberschrift zum Beitrag » Es wird wieder gebaggert! Under construction zum Beitrag » Den Artikel lesen: Letzer Test, Den Artikel lesen: Test, Den Artikel lesen: Es wird wieder gebaggert!, Banner',11.06,'78690944164fa31fee6138884c527566','','0','de'),(61,17,1465824931,'Fotos','de/fotos.html','Fotos Fotos Beachcup News Get Ready! 13.06.2016 Anmeldetermin für Klausen zum Beitrag » Ergebnisse Dorf Tirol 07.06.2016 Routiniers an der Spitze zum Beitrag » Auf die Plätze, fertig, los! 01.06.2016 Traditioneller Start in Dorf Tirol zum Beitrag » Wie melde ich mich an? 23.05.2016 Ein kurzer Leitfaden zum Beitrag » Es wird wieder gebaggert 06.05.2016 Beachcup 2016 zum Beitrag » Den Artikel lesen: Get Ready!, Den Artikel lesen: Ergebnisse Dorf Tirol, Den Artikel lesen: Auf die Plätze, fertig, los!, Den Artikel lesen: Wie melde ich mich an?, Den Artikel lesen: Es wird wieder gebaggert, Banner',12.69,'efe8671aa3fe93867da63cb0312875c7','','0','de'),(62,18,1465867586,'Videos','de/videos.html','Videos Videos Raiffeisen Beachcup 2015 Playlist Raiffeisen Beachcup 2014 Playlist Raiffeisen Bank The Future Beachcup 2013 Playlist Raiffeisen Bank The Future Beachcup 2012 Playlist Raiffeisen Bank The Future Beachcup 2011 Playlist Raiffeisen Bank The Future Beachcup 2010 Playlist Beachcu