n Meinung, da diese nicht immer unserer Meinung entsprechen kann. Copyright: © SSV Bruneck Amateuersportverein Nutzung von Cookies Diese Website verwendet Cookies und verwandte Technologien um das korrekte Funktionieren zu ermöglichen und die Nutzung der angebotenen Dienste zu erleichtern. Was sind Cookies? Ein Cookie ist ein kurzes Text-Snippet, das von einer von Ihnen besuchten Website an Ihren Browser gesendet wird. Es speichert Informationen zu Ihrem letzten Besuch, wie Ihre bevorzugte Sprache oder andere Einstellungen. So finden Sie sich auf der Website schneller zurecht und nutzen sie effektiver, wenn Sie sie das nächste Mal aufrufen. Cookies spielen eine wichtige Rolle. Ohne sie wäre das Surfen im Web oft frustrierend. Warum nutzen wir Cookies? Wir nutzen diese Informationen, um unsere Website zu verbessern, damit unsere Besucher das bestmögliche Angebot erhalten. Unsere Plattform verwendet auch Cookies und ähnliche Technologien von sorgfältig ausgewählten Drittanbietern. Arten von Cookies Diese Website verwendet folgende Cookies: technische Cookies und Cookies für analytische Zwecke: diese Cookies sammeln Informationen über die Nutzung der Website und helfen uns Auswertungen über die Auffindbarkeit der Informationen auf unserer Seite zu bekommen. Dies erfolgt zum Teil über einen Drittanbieter (Google). Diese Informationen sind nicht personenbezogen. Drittanbieter-Cookies: dies sind Cookies von anderen Anbietern. Beispiele dafür sind “social plugins” für Facebook, Twitter und Google+. Der Sinn davon ist z.B. das Teilen von Inhalten auf dne Social Network Plattformen zu ermöglichen oder zu erleichtern. Genaueres erfahren Sie auf den Informations-Seiten der Drittanbieter. Cookies verwalten Sie können Cookies nach Belieben steuern und/oder löschen. Wie, erfahren Sie hier. Sie können alle auf Ihrem Rechner abgelegten Cookies löschen und die meisten Browser so einstellen, dass die Ablage von Cookies verhindert wird. Dann müssen Sie aber möglicherweise einige Einst