'0','it'),(66,45,1466224524,'Regolamento','it/reglolamento.html','Regolamento Regolamento 2016 Regole di gioco: Per il \"Raiffeisen Beachcup\" valgono le regole internazionali del beach volley. Ulteriori informazioni sulle regole le trovate sul sito ufficiale FIVB o scaricando: Regole di gioco FIVB. Direttive tecniche riguardo lo svolgimento delle tappe giovanili del Beachcup L’OK Team del Beachcup vorrebbe definire alcune regole di base in collaborazione con la FIPAV Bolzano, per garantire il continuo incremento del settore giovanile nel beach volley in Alto Adige. Scarica il regolamento Condizioni per la partecipazione: Al Raiffeisen Beachcup possono partecipare tutti gli atleti tesserati FIPAV e dei quali la società di appartenenza non ha dato il divieto per l\'attività di beach volley tramite il portale FIPAV online. Tutti i non tesserati presso la Federazione Italiana Pallavolo FIPAV possono richiedere tramite il modulo di iscrizione (liberatoria) un \"tesseramento per singola manifestazione amatoriale\" quale salvo accettazione autorizza alla partecipazione al singolo torneo/tappa. Categoria \"OPEN\" Uomini/Donne: La partecipazione al torneo è consentita solo presentando un certificato medico valido (medico di fiducia o medico sportivo) che certifica l\'idoneità illimitata per lo sport praticato. Categoria \"AMATORIALE Uomini“: Possono partecipare tutti gli atleti in possesso di un certificato medico valido (medico di fiducia o medico sportivo) che certifica l\'idoneità illimitata per lo sport praticato e che nella stagione invernale hanno al massimo giocato nel campionato italiano di Serie D e che in carriera non hanno mai giocato nel campionato italiano di Serie B2 o superiore. Questo vale anche per tutti i campionati paragonabili di un\'altro paese. Anche i giocatori semifinalisti della categoria Open delle utlime due edizioni del Raiffeisen Beachcup sono esclusi. Possono participare anche squadre con atleti oltre i 40 anni o squadre con un atleta sotto i 16 anni. Il comitato organizzatore si riserva di escludere anche singoli giocatori o squadre ritenute di alto livello. Per le coppie mixed non c\'è una classifica separata e nessuna limitazione riguardante il loro livello di gioco. Categoria giovanile: Tutti i giovani devono presentare un certificato medico valido (medico di fiducia o medico sportivo) che certifica l\'idoneità illimitata per lo sport praticato. Si gioca nelle seguenti categorie: U18 femminile: nati dopo il 01.01.1999 U17 maschile: nati dopo il 01.01.2000 U16 femminile: nati dopo il 01.01.2001 U15 maschile: nati dopo il 01.01.2002 U14 femminile: nati dopo il 01.01.2003 U13 maschile: nati dopo il 01.01.2004 Iscrizioni: L\'iscrizione può essere fatta soltanto online sul sito www.beachcup.it entro le ore 18:00 del mercoledì precedente ad ogni singola tappa e fino all\' esaurimento dei posti liberi. L\'iscrizione è valida solo se entro le ore 18:00 del mercoledì precedente alla prima tappa di partecipazione del atleta la liberatoria e il certificato medico sono stati mandati al numero fax 0474 05 06 08 o a info@beachcup.it. Informazioni: Tel. +39 393 7064116 o via email: info@beachcup.it Modalità del torneo: L\'evento è composto da più tappe e diverse categorie. (Dettagli sulle singole tappe vedasi sotto Tornei 2016). Categorie: - Open femminile e maschile - Amatoriale maschile - Under 18 femminile e Under 17 maschile - Under 16 femminile e Under 15 maschile - Under 14 femminile e Under 13 maschile Non è possibile iscriversi a piu di una categoria in una giornata. Nella fase di qualificazione (giochi di gruppo) si gioca un set fino ad un mimimo di 15 punti (Rally-Point System). Per la vittoria è necessario avere due punti di vantaggio. Le prime due squadre di ogni gruppo si qualificano per il turno successivo. Dagli ottavi si gioca un set fino a 21 punti. La finale verrà decisa in due set vincenti (3. Set fino a 15 punti). Se una squarda dopo l\'annuncio della partita (previsto dal tabellone) non si presenta entro cinque minuti sul campo da gioco, la partita sarà persa col punteggio di 15:8 o 21:11. Per le categorie U13 e U14 il campo da gioco sara ridotto su 7 x 14 m, tutte le altre categorie si giocano sul campo 8 x 16 m. Per l\'altezza rete vale: U14f - 2,05m | U13m - 2,05m U16f - 2,20m | U15m - 2,20m U18f/Donne - 2,24m | U17/Uomini - 2,43m Classifica finale: Open: La somma dei punti di ogni tappa della squadra partecipante dà il risultato finale. Nel caso in cui 2 o più squadre abbiano lo stesso punteggio nella classifica finale, decide il maggior numero di partecipazioni al Raiffeisen Beachcup. In caso di parità viene presa in considerazione il miglior piazzamento. Amatoriale maschile: Le tre tappe della categoria \"Amatoriale\" e le due tappe \"Open\" valgono per la classifica finale amatoriale però nella classifica finale contano solo i quattro piazzamenti migliori (punteggio!!!). Per la paritá punti conta come descritto per l\'OPEN. Giovanile: Non è previsto una classifica finale. Punti: I punti vanno aggiudicati a squarda. 1° posto - 100 punti 2° posto - 90 punti 3° posto - 80 punti 4° posto - 70 punti squadra perdente ai quarti - 60 punti squadra perdente agli ottavi - 50 punti terzultima classificata nel gruppo - 40 punti penultima classificata nel gruppo - 30 punti ultima classificata nel gruppo - 20 punti I punti verranno aggiudicati a squadra. L\'ultima tappa dà il doppio dei punti. (1° posto - 200 punti; 2° posto - 180 punti; 3° posto - 160 punti; ecc.) Quota d\'iscrizione: Nella quota d\'iscrizione è inclusa l\'entrata nella rispettiva piscina (se disponibile) e inoltre una maglietta del \"Raiffeisen Beachcup\" per giocatore per tutte le tappe. I clienti \"Bank The Future\" hanno diritto ad uno sconto del 20%. Per ogni ulteriore maglietta verranno richieste le spese d\'acquisto di € 15,00 (materiale e stampa). Categoria prima tappa partecipata tappe successive clienti \"Bank The Future\" Open 55 Euro 45 Euro 20% di sconto Amatoriale 45 Euro 35 Euro 20% di sconto Giovanile 35 Euro 25 Euro 20% di sconto Importante: Per partecipanti che non sono regolarmente tesserati presso la Federazione Italiana Pallavolo FIPAV e che tramite modulo di iscrizione (liberatoria) richiedono un \"tesseramento per songola manifestazione amatoriale\" sono tenuti a corrispondere ulteriori 2,00€ per tappa/torneo. Se una squadra non si presenta ad una tappa senza aver tempestivamente disdetto, deve pagare ugualmente la quota d\'iscrizione. Vestiario: I giocatori sono obbligati ad usare sempre la maglietta ufficiale del torneo durante le partite. Pallone di gioco: Il pallone ufficiale del \"Raiffeisen Beachcup\" è il Mikasa VLS300. Il pallone per le partite viene fornito dall\'O.K.. Montepremi per singola tappa: Categoria Open maschile e femminile: 1a squadra classificata 100 €, premi vari per le prime quattro squadre classificate Categoria amatoriale: Premi vari per le prime quattro squadre classificate Categoria giovanile: Premi vari. Montepremi per la classifica finale: Categoria Open maschile e femminile: 1° posto: 400 € 2° posto: 200 € 3° posto: 100 € Categoria amatoriale: Premi vari per le prime tre squadre classificate Premiazione: La premiazione avverrà direttamente dopo ogni torneo. Programma: Durante tutte le tappe vengono offerti dei programmi speciali. Per informazioni dettagliate vedere la pagina dell\' organizzatore locale seguendo l\'apposito link sotto Tornei 2016. Organizzazione: Il \"Raiffeisen Beachcup\" viene coordinato dalla società SSV Bruneck Amateursportverein sezione pallavolo e organizzato dai vari organizzatori locali. Per informazioni dettagliate vedere la pagina dell\' organizzatore locale seguendo l\'apposito link sotto Tornei 2016. Il comitato organizzativo funge solo come coordinatore del tour. Alle singole tappe provvedono gli organizzatori locali. La partecipazione è a proprio rischio. Il corrdinatore e gli organizzatori respingono ogni responsabilità per infortuni prima, durante e dopo i tornei, neanche contro terzi. Ogni atleta è responsabile personalmente per la propria salute. Modifiche: In caso di necessità il comitato organizzativo può modificare il regolamento in ogni momento per garantire un buon funzionamento del torneo. Il sito internet www.beachcup.it è l\'ufficale fonte di informazione della manifestazione. Per questa ragione tutte le comunicazioni saranno publicate su quel sito. Beachcup News Get Ready! 13.06.2016 Data d\'iscrizione per Chiusa mostra articolo » Risultati Tirolo 07.06.2016 In testa noti altoatesini mostra articolo » Pronti, attenti e via! 01.06.2016 Inizio tradizionale a Tirolo mostra articolo » Come mi iscrivo? 23.05.2016 Una breve guida mostra articolo » Back to the Beach 06.05.2016 Beachcup 2016 mostra articolo » Leggi l\'articolo: Get Ready!, Leggi l\'articolo: Risultati Tirolo, Leggi l\'articolo: Pronti, attenti e via!, Leggi l\'articolo: Come mi iscrivo?, Leggi l\'articolo: Back to the Beach, Banner',23.34,'0223f3a330e969a5244043effa23ad1d','','0','it'),(67,49,1466079276,'Classifiche','it/classifiche.html','Classifiche Classifiche Amatoriale maschile ',16.53,'544e6693d393b25ad023b5c6b33d45fb','','0','it'),(69,10,1465941765,'Etappen','de/etappen/stage/20.html','Etappen Etappen Bruneck - VSS Landesmeisterschaft 13. bis 14. August 2016 Turniere und angemeldete Teams Damen (13. August 2016) Herren (13. August 2016) U15 männlich (13. August 2016) U16 weiblich (13. August 2016) U13 männlich (14. August 2016) U14 weiblich (14. August 2016) U17 männlich (14. August 2016) U18 weiblich (14. August 2016) Veranstaltungsort Freibad Bruneck Die Beachvolleyballanlage im Brunecker Freischwimmbad zählt zu den schönsten unseres Landes. Die vier ausgezeichnet präparierten Beachplätze sind mit demselben Quarzsand wie beim jährlich stattfindenden Weltcup in Klagenfurt ausgestattet. Im Frühjahr 2012 wurden die Innenplätze generalsaniert und bieten ideale Verhältnisse für spannende Duelle im Sand. Weiters stehen vor dem Freischwimmbad, wie schon in den letzten Jahren, zwei weitere Beachplätze den ganzen Sommer zur Verfügung. Adresse: Neurauthstrasse 139031 Bruneck Organisator SSV Bruneck - Sektion Volleyball Klaus Seeber info@beachcup.it +39 0474 050608 +39 393 7064116 Beachcup News Get Ready! 13.06.2016 Anmeldetermin für Klausen zum Beitrag » Ergebnisse Dorf Tirol 07.06.2016 Routiniers an der Spitze zum Beitrag » Auf die Plätze, fertig, los! 01.06.2016 Traditioneller Start in Dorf Tirol zum Beitrag » Wie melde ich mich an? 23.05.2016 Ein kurzer Leitfaden zum Beitrag » Es wird wieder gebaggert 06.05.2016 Beachcup 2016 zum Beitrag » Den Artikel lesen: Get Ready!, Den Artikel lesen: Ergebnisse Dorf Tirol, Den Artikel lesen: Auf die Plätze, fertig, los!, Den Artikel lesen: Wie melde ich mich an?, Den Artikel lesen: Es wird wieder gebaggert, Banner',14.66,'c1c5750f081b6fffa3199d277536cdf8','','0','de'),(70,10,1465906233,'Etappen','de/etappen/stage/18.html','Etappen Etappen Sterzing 23. bis 24. Juli 2016 Turniere und angemeldete Teams Freizeit Herren (23. Juli 2016) U13 männlich (24. Juli 2016) U14 weiblich (24. Juli 2016) U17 männlich (24. Juli 2016) U18 weiblich (24. Juli 2016) Veranstaltungsort Balneum Sterzing Das „Balneum Sterzing“ ist ein Sport- und Relaxbad für die ganze Familie und bietet im Sommerbetrieb Platz für mehr als 1.000 Badegäste und Sportbegeisterte. Das beliebte Schwimmbad bietet auf einer großen Liegewiese, mit sonnigen und schattigen Plätzen, ein großen Außenbecken mit dem neuen Kinderbecken sowie ein auch im Sommer zugänglichen Innenbecken! Das Restaurant mit sonniger Terrasse bietet allen Gästen den ganzen Tag über Erfrischungsgetränke und Essen! Adresse: Karl-Riedmann-Platz 539049 Sterzing Organisator Volleyball Sterzing Egon Volgger coolsport@gmx.net +39 335 5915562 Beachcup News Get Ready! 13.06.2016 Anmeldetermin für Klausen zum Beitrag » Ergebnisse Dorf Tirol 07.06.2016 Routiniers an der Spitze zum Beitrag » Auf die Plätze, fertig, los! 01.06.2016 Traditioneller Start in Dorf Tirol zum Beitr