appe verantwortlich. zum Beitrag » Wie melde ich mich an? Ein kurzer Leitfaden 2016-05-23 Mit unserer neuen Homepage hat sich auch der Anmeldeprozess etwas geändert. In diesem Beitrag sollen euch die nötigen Schritte dazu erklärt werden. zum Beitrag » Es wird wieder gebaggert Beachcup 2016 2016-05-06 Die Beachvolleyballsaison kann losgehen und dafür wurden auch die Termine der Raiffeisen Beachcup Turnierserie festgelegt. Das OK Team hat sich wieder Mühe gegeben, die Etappen und Kategorien so zu gestalten, dass die Nachfrage möglichst gedeckt wird. Wie ihr seht, wurde zusätzlich an einem neuen Internetauftritt gearbeitet. zum Beitrag » Beachcup News Get Ready! 2016-06-13 Anmeldetermin für Klausen zum Beitrag » Ergebnisse Dorf Tirol 2016-06-07 Routiniers an der Spitze zum Beitrag » Auf die Plätze, fertig, los! 2016-06-01 Traditioneller Start in Dorf Tirol zum Beitrag » Wie melde ich mich an? 2016-05-23 Ein kurzer Leitfaden zum Beitrag » Es wird wieder gebaggert 2016-05-06 Beachcup 2016 zum Beitrag » Den Artikel lesen: Get Ready!, Den Artikel lesen: Ergebnisse Dorf Tirol, Den Artikel lesen: Auf die Plätze, fertig, los!, Den Artikel lesen: Wie melde ich mich an?, Den Artikel lesen: Es wird wieder gebaggert, Banner',32.69,'18f72b445c07ffe6b7d330ebd38bbc2f','','0','de'),(92,23,1465814673,'Wie melde ich mich an?','de/nachrichten/wie-melde-ich-mich-an.html','Wie melde ich mich an? Mit unserer neuen Homepage hat sich auch der Anmeldeprozess etwas geändert. In diesem Beitrag sollen euch die nötigen Schritte dazu erklärt werden. Wie melde ich mich an? 23.05.2016 15:58 von Redaktion Ein kurzer Leitfaden Mit unserer neuen Homepage hat sich auch der Anmeldeprozess etwas geändert. Wir hoffen, euch mit diesem Leitfaden dabei helfen zu können. Zunächst möchten wir darauf hinweisen, daß immer nur eine Etappe zur Anmeldung freigeschaltet ist. Wir sind ein Team, wie melden wir uns an? Es reicht, wenn ein Spieler die Anmeldung für das Team übernimmt, welche wie folgt abläuft: Registrierung durchführen (Nicht vergessen: Aktivierungslink in zugesandtem Mail anklicken) Login Gebe im Menü \"My Beachcup\" in Schritt 1 (Meine Spieler) die Spielerdaten ein Stelle im Menü \"My Beachcup\" in Schritt 2 (Meine Teams) dein Team zusammen Melde im Menü \"My Beachcup\" in Schritt 3 (Meine Anmeldungen) dein Team zu einem Turnier an Sollte das ausgewählte Turnier nicht bereits ausgebucht sein, erhält eure Anmeldung den Status \"in Bearbeitung\" und wird vom Organisations-Team nach Überprüfung auf Regelkonformität auf \"bestätigt\" gesetzt. Sollte das Turnier ausgebucht sein, erhält eure Anmeldung den Status \"Turnier ausgebucht, auf Warteliste\". Den Status \"unvollständig\" erhält eure Anmeldung für den Fall, daß die ärztlichen Zeugnisse und/oder die Eigenerklärungen nicht vollständig eingereicht wurden. Näheres zu Einreichemöglichkeiten und Einreichefrist dieser Dokumente findet ihr im Reglement im Abschnitt \"Einschreibungen\". Spielerdaten und Teamzusammenstellungen bleiben natürlich für alle weiteren Etappen in deinem Loginbereich erhalten. Es ist natürlich möglich, mehr als zwei Spieler und mehr als ein Team anzulegen, für den Fall, daß man die Teamzusammenstellung wechselt. Wir sind eine Gruppe/Verein, wie melde ich unsere Teams an? Es reicht, wenn der Gruppenleiter oder Trainer/Betreuer die oben genannten Schritte durchführt, d.h. alle Teilnehmer zunächst als Spieler anlegt, die Teams zusammenstellt und die Anmeldugen durchführt. Auch hier gilt, daß jederzeit neue Spieler hinzugefügt und neue Teams zusammengestellt werden können. Wir hoffen, euch damit geholfen zu haben, euer Beachcup-Team! Beachcup News Get Ready! 13.06.2016 Anmeldetermin für Klausen zum Beitrag » Ergebnisse Dorf Tirol 07.06.2016 Routiniers an der Spitze zum Beitrag » Auf die Plätze, fertig, los! 01.06.2016 Traditioneller Start in Dorf Tirol zum Beitrag » Wie melde ich mich an? 23.05.2016 Ein kurzer Leitfaden zum Beitrag » Es wird wieder gebaggert 06.05.2016 Beachcup 2016 zum Beitrag » Den Artikel lesen: Get Ready!, Den Artikel lesen: Ergebnisse Dorf Tirol, Den Artikel lesen: Auf die Plätze, fertig, los!, Den Artikel lesen: Wie melde ich mich an?, Den Artikel lesen: Es wird wieder gebaggert, Banner',15.85,'16e130ffa6a0479cfcb60f17724e259b','','0','de'),(93,42,1465827194,'Come mi iscrivo?','it/notizie/come-mi-iscrivo.html','Come mi iscrivo? Con il nostro nuovo sito é cambiato anche il processo di iscrizione ai tornei. In questo articolo vogliamo spiegarvi come si fa. Come mi iscrivo? 23.05.2016 17:00 a cura di Redaktion Una breve guida Con il nostro nuovo sito é cambiato anche il processo di iscrizione ai tornei. In questo articolo vogliamo spiegarvi come si fa. Prima di tutto vogliamo accennare che é possibile iscriversi sempre solamente a una, la seguente, tappa. Siamo una squadra, come ci iscriviamo? Basta che uno dei due giocatori si registri sul nostro sito ed effettui l\'iscrizione per tutti e due come segue: Registrazione (Non dimenticatevi di cliccare il link di attivazione nella mail che segue all\'inserimento dei vostri dati) Login Inserisci nel menu \"My Beachcup\" sotto Fase 1 (I miei giocatori) i dati dei giocatori Crea nel menu \"My Beachcup\" sotto Fase 2 (Le mie squadre) la vostra squadra Iscriviti nel menu \"My Beachcup\" sotto Fase 3 (Le mie iscrizioni) ai tornei della tappa seguente In caso il torneo scelto fosse giá esaurito la vostra iscrizione riceverá lo stato \"torneo esaurito, in lista d\'attesa\". Nel caso non fosse giá esaurito riceverá lo stato \"da verificare\" e cambierá nello stato \"confermato\" dopo risultando conforme al nostro regolamento. Lo stato \"incompleto\" verrá assegnato alla vostra iscrizione se mancano certificati medici e/o liberatorie. Le possibilitá su come e soprattutto fino a quando ci dovete consegnare questi documenti le trovate nel regolamento sotto \"Iscrizioni\". I dati dei giocatori e le formazioni delle squadre rimangono ovviamente salvate da tappa a tappa nella vostra area riservata. É naturalmente possibile inserire dati di piú di due giocatori e di creare piú di una squadra, specialmente quando le formazioni dei team cambiano da tappa a tappa. Siamo un gruppo o un\'associazione, come iscrivo i miei giocatori? Anche in questo caso basta che una persona, il responsabile del gruppo, esegui i passi su nominati, cioé inserire tutti i dati dei giocatori, creare le squadre e iscrivere queste a uno o piú tornei. Anche qui vale lo stesso come detto prima, cioé che in ogni momento si puó aggiungere nuovi giocatori e creare nuove coppie. Speriamo che vi siamo stato d\'aiuto con questa breve guida, il vostro Beachcup team! Beachcup News Get Ready! 13.06.2016 Data d\'iscrizione per Chiusa mostra articolo » Risultati Tirolo 07.06.2016 In testa noti altoatesini mostra articolo » Pronti, attenti e via! 01.06.2016 Inizio tradizionale a Tirolo mostra articolo » Come mi iscrivo? 23.05.2016 Una breve guida mostra articolo » Back to the Beach 06.05.2016 Beachcup 2016 mostra articolo » Leggi l\'articolo: Get Ready!, Leggi l\'articolo: Risultati Tirolo, Leggi l\'articolo: Pronti, attenti e via!, Leggi l\'articolo: Come mi iscrivo?, Leggi l\'articolo: Back to the Beach, Banner',15.76,'6d7cd405e47e701872d67f60a6017dc0','','0','it'),(94,23,1465844475,'Auf die Plätze, fertig, los!','de/nachrichten/auf-die-plaetze-fertig-los.html','Auf die Plätze, fertig, los! Die erste Station des Raiffeisen Beachcups heißt auch in diesem Jahr wieder Dorf Tirol. Die lokalen Organisatoren des AS Merano Volley tragen am kommenden Wochenende die erste … Auf die Plätze, fertig, los! 01.06.2016 14:37 von Redaktion Traditioneller Start in Dorf Tirol Die erste Station des Raiffeisen Beachcups heißt auch in diesem Jahr wieder Dorf Tirol. Die lokalen Organisatoren des AS Merano Volley tragen am kommenden Wochenende die erste OPEN-Etappe aus und STS-Volley aus Bozen ist für die erste JUGEND Etappe verantwortlich. Am Samstag, 4. Juni beginnt die Beachcup-Saison mit der JUGEND Etappe. Die Altersklassen sind gemäß dem italienischen Kategoriensystem in U18, U16 und U14 bei den Mädchen und in U17, U15 und U13 bei den Jungs eingeteilt. Zahlreiche junge Südtiroler werden ihr Können unter Beweis stellen und sich mit österreichischen Jugendlichen und Kids aus anderen Regionen Italiens messen. Am Sonntag, 5. Juni sind dann die Erwachsenen an der Reihe. Das heißt Heimspiel für die amtierenden Landesmeister Kevin Huber und Alexander Somvi aus Dorf Tirol und Götsch/Pixner aus dem Passeiertal. Aber auch andere Teams aus dem Land wollen beim Kampf und die Trophäe ein Wörtchen mitreden. So etwa die Vize-Landesmeister aus Bruneck Gröber/Kargruber oder die Jugend-Auswahlspieler Lukas Ellemunt und Jakob Windisch. Die beiden Sterzinger haben in letzter Zeit mit einigen guten Ergebnissen, zuletzt einem Sieg bei einem C-Cup in Tirol, auf sich aufmerksam gemacht. Und auch bei den Damen sind bereits zahlreiche Teams aus dem Norden Italiens für die Etappe in Dorf Tirol gemeldet. Hier sind wir gespannt, welche neuen Gesichter auf den Plätzen Südtirols zu sehen sind und wer sich in diesem Jahr beim Raiffeisen Beachcup durchsetzen wird. Die Anmeldungen für die Etappe in Dorf Tirol sind noch bis Mittwoch möglich. Wer in Dorf Tirol an den Start geht seht ihr auf der Etappenseite von Dorf Tirol. Dies die Spielpläne für diese Etappe: Samstag: Jugend Sonntag: Open Neue Homepage – Neuer Anmeldeprozess Durch den Relaunch der Homepage ist auch das Anmeldeverfahren neu. Nach der Registrierung auf www.beachcup.it kann ein Spieler sein Team zusammenstellen und zu einer Etappe anmelden. So ist es beispielsweise für Trainer einfacher, seine Jugendspieler in einem Schritt anzumelden, nachdem die Spieler einmal eingetragen worden sind. Beachcup News Get Ready! 13.06.2016 Anmeldetermin für Klausen zum Beitrag » Ergebnisse Dorf Tirol 07.06.2016 Routiniers an der Spitze zum Beitrag » Auf die Plätze, fertig, los! 01.06.2016 Traditioneller Start in Dorf Tirol zum Beitrag » Wie melde ich mich an? 23.05.2016 Ein kurzer Leitfaden zum Beitrag » Es wird wieder gebaggert 06.05.2016 Beachcup 2016 zum Beitrag » , Den Artikel lesen: Get Ready!, Den Artikel lesen: Ergebnisse Dorf Tirol, Den Artikel lesen: Auf die Plätze, fertig, los!, Den Artikel lesen: Wie melde ich mich an?, Den Artikel lesen: Es wird wieder gebaggert, Banner',16.09,'9a47fd03d4cb5e7daaa70682c67be204','','0','de'),(95,42,1465819165,'Pronti, attenti e via!','it/notizie/pronti-attenti-e-via.html','Pronti, attenti e via! Come già negli anni passati, la prima tappa del Raiffeisen Beachcup si terrà a Tirolo. I magnifici tre campi da beach volley di Tirolo e i calorosi organizzatori locali dell’AS … Pronti, attenti e via! 01.06.2016 14:48 a cura di Redaktion Inizio tradizionale a Tirolo Sabato, 4 giugno si comincerà con le categorie giovanili, a differenza dell’anno scorso. Per rendere i tornei giovanili uniformi al sistema categorico italiano sono stati suddivisi nelle seguente fasce di età: U18, U16 e U14 nel femminile e U17, U15 e U13 nel maschile. Tanti giovani talenti altoatesini si metteranno alla prova e si misureranno con coetanei provenienti da altre regioni italiane e anche dall’Austria. Domenica, 5 giugno poi sarà il turno degli adulti. I campioni provinciali dell’anno scorso Kevin Huber e Alexander Somvi quindi giocheranno in casa, come anche Götsch/Pixner della Val Passiria. Nonostante questo vantaggio, anche altri accoppiamenti dell’Alto Adige vogliono dire la loro in questo torneo, come per esempio i vice campioni provinciali Gröber/Kargruber e anche i giovani Lukas Ellemunt ed il suo compagno Jakob Windisch. Questi ultimi, provenienti da Vipiteno, hanno già fatto vedere di cosa sono capaci, ultimamente con una vittoria di un torneo della categoria “C” in Austria. Anche nel femminile si sono iscritte già numerose coppie del Norditalia per il torneo a Tirolo. Rimane però interessante vedere quali nuovi volti verranno a trovarci sui campi da beach volley altoatesini e a chi andrà questo primo titolo del Raiffeisen Beachcup. Iscrizioni ai tornei di Tirolo verranno accettati ancora fino a mercoledì sera. Le squadre partecipanti si possono vedere sul sito relativo alla tappa di Tirolo. I tabelloni per questa tappa: Sabato: Giovanile Domenica: Open Il nuovo sito internet comporta inoltre anche un nuovo metodo d’iscrizione. Dopo aver effettuato la registrazione dei singoli pallavolisti, un membro della squadra può effettuare l’iscrizione alla tappa desiderata. Quindi diventa più facile per gli allenatori delle giovanili iscrivere i loro protetti. Beachcup News Get Ready! 13.06.2016 Data d\'iscrizione per Chiusa mostra articolo » Risultati Tirolo 07.06.2016 In testa noti altoatesini mostra articolo » Pronti, attenti e via! 01.06.2016 Inizio tradizionale a Tirolo mostra articolo » Come mi iscrivo? 23.05.2016 Una breve guida mostra articolo » Back to the Beach 06.05.2016 Beachcup 2016 mostra articolo » , Leggi l\'articolo: Get Ready!, Leggi l\'articolo: Risultati Tirolo, Leggi l\'articolo: Pronti, attenti e via!, Leggi l\'articolo: Come mi iscrivo?, Leggi l\'articolo: Back to the Beach, Banner',15.61,'b81e4355ff38f908f24ccbc63c09ebef','','0','it'),(96,23,1465911266,'Ergebnisse Dorf Tirol','de/nachrichten/ergebnisse-dorf-tirol.html','Ergebnisse Dorf Tirol Ausgeglichene und freundschaftliche Stimmung herrschte am Sonntag bei der ersten OPEN-Etappe des Raiffeisen Beachcups in Dorf Tirol. Erstmalig waren mehr Damen- als Herrenteams … Ergebnisse Dorf Tirol 07.06.2016 08:56 von Redaktion Routiniers an der Spitze Ausgeglichene und freundschaftliche Stimmung herrschte am Sonntag bei der ersten OPEN-Etappe des Raiffeisen Beachcups in Dorf Tirol. Erstmalig waren mehr Damen- als Herrenteams gemeldet, darunter viele Nachwuchsteams, die sich bei den Herren und bei den Damen bis in das Finale vorarbeiteten. Doch zum Schluss siegte die Routine über die jugendliche Leichtigkeit. Bei den Herren setzen sich die Lokalmatadoren Alexander Somvi und Kevin Huber gegen das Nachwuchsteam Lukas Ellemunt und Jakob Windisch aus Sterzing durch, nachdem diese das Spiel in der Vorrunde noch klar für sich entscheiden konnten. Mit guten Aufschlägen, vielen Breakpunkten und Unterstützung des heimischen Publikums konnten die zwei erfahrenen Dorf Tiroler die jungen Sterzinger dann aber im Finalevon Beginn an unter Druck setzen. Ellemunt/Windisch fanden so kaum ins Spiel und die amtierenden Landesmeister im Beachvolleyball Somvi/Huber gewinnen klar mit 2:0 (21:14, 21:17). Sie holen sich damit die ersten 100 Punkte für die Gesamtwertung. Bei den Damen zeigte sich imFinale ein ähnliches Bild. Die beiden erfahrenen Spielerinnen Roberta Camarda und Pamela Guglielmetti, die schon einige Siege beim Raiffeisen Beachcup auf ihrem Konto haben, standen dem Nachwuchsteam Emma Kudoglu und Francesca Michieletto aus Trient gegenüber. Und auch hier setze sich in einem hart umkämpften Spiel die Routine durch und Camarda/Guglielmetti gewinnen mit 2:0 (21:15, 21:15) die erste Etappe des Raiffeisen Beachcups. Die Spiele um Platz drei waren bei den Damen und Herren jeweils in Südtiroler Hand. Bei den Herren gewannen die Altmeister aus dem Passeiertal Filip Götsch und Markus Pixner mit 2:0 (15:9, 17:15) gegen die Vizelandesmeister Markus Gröber und Martin Kargruber. Aurora Bazzanella und Chiara Pedrotti gehen mit 2:0 (15:9, 15:7) als Siegerinnen aus dem Spiel gegen Verena Ganthaler und Sabine Botzner. Am Tag zuvor kämpften 36 Burschen- und Mädchenteams in jeweils 3 Kategorien um die Siege der ersten JUGEND Etappe. Spannende Ballwechsel, viel Einsatz und ehrgeizige Spiele wurden den Zuschauern geboten. Zum Schluss waren bei den Burschen alle drei Kategorien fest in der Hand des SSV Bruneck, hingegen bei den Mädchen die Spielerinnen aus Bozen ebenfalls alle Kategorien dominierten. Die beiden Veranstalter, der AS Merano Volley und das STS –Sport Team Südtirol schauen auf eine gelungene erste Etappe in Dorf Tirol zurück und wir sind gespannt, was uns beim nächsten Turnierstopp in Klausen erwartet. Hier findet am Samstag, 02.07. die erste FREIZEIT-Etappe statt und am Sonntag, 03.07. eine weitere JUGEND-Etappe. Alle Ergebnisse: Jugend-Turniere Open-Turniere Beachcup News Get Ready! 13.06.2016 Anmeldetermin für Klausen zum Beitrag » Ergebnisse Dorf Tirol 07.06.2016 Routiniers an der Spitze zum Beitrag » Auf die Plätze, fertig, los! 01.06.2016 Traditioneller Start in Dorf Tirol zum Beitrag » Wie melde ich mich an? 23.05.2016 Ein kurzer Leitfaden zum Beitrag » Es wird wieder gebaggert 06.05.2016 Beachcup 2016 zum Beitrag » , Den Artikel lesen: Get Ready!, Den Artikel lesen: Ergebnisse Dorf Tirol, Den Artikel lesen: Auf die Plätze, fertig, los!, Den Artikel lesen: Wie melde ich mich an?, Den Artikel lesen: Es wird wieder gebaggert, Banner',16.59,'382942f6712624f035b2e35ccb8580ea','','0','de'),(97,42,1465884928,'Risultati Tirolo','it/notizie/risultati-tirolo.html','Risultati Tirolo Atmosfera calorosa e partite combattute a Tirolo lo scorso finesettimana nella prima tappa OPEN del Raiffeisen Beachcup a Tirolo. Per la prima volta in assoluto c’erano più squadre … Risultati Tirolo 07.06.2016 09:00 a cura di Redaktion In testa noti altoatesini Atmosfera calorosa e partite combattute a Tirolo lo scorso finesettimana nella prima tappa OPEN del Raiffeisen Beachcup a Tirolo. Per la prima volta in assoluto c’erano più squadre femminili partecipanti che maschili. Tra di queste anche molte giovani coppie che se la sono giocata alla grande, arrivando anche in finale. Alla fine però è stata l’esperienza a dominare sulla gioventù. Nel maschile ha vinto la squadra di casa Alexander Somvi e Kevin Huber, vincendo la finale contro i giovani Lukas Ellemunt e Jakob Windisch che nella stessa sfida nella fase a gironi sono riusciti a dominare chiaramente i Tirolesi. Nella finale però l’accoppiamento di casa ha messo in difficoltà i giovani beacher con battute vincenti, tanti break e il supporto di tutto il pubblico presente dall’inizio. Così Ellemunt/Windisch non sono riusciti ad entrare in partita e i campioni provinciali in carica Somvi/Huber si sono aggiudicati il titolo e i primi 100 punti per la classifica finale in due set (21:14, 21:17). Nel femminile si è visto più o meno lo stesso scenario. Le due esperte Roberta Camarda e Pamela Guglielmetti che hanno vinto già tante volte delle tappe OPEN negli anni passati, si sono confrontate con le due giovani trentine Emma Kudoglu e Francsca Michieletto nella finale. Anche qui però l’esperienza ha dominato, in quanto sono uscite vincitrici dalla partite entusiasmante le esperte Camarda/Guglielmetti in due set (21:15, 21:15). Le finaline invece se le sono giocate solo coppie altoatesine, sia nel femminile che nel maschile. Filip Götsch e Markus Pixner della Val Passiria hanno avuto la meglio contro i vice campioni provinciali Markus Gröber e Martin Kargruber per 2:0 (15:9, 17:15) e Aurora Bazzanella con Chiara Pedrotti si sono aggiudicate il terzo posto vincendo contro Verena Ganthaler e Sabine Botzner, anche per 2:0 (15:9, 15:7). Il giorno prima sono stati giocati sugli stessi campi da beach a Tirolo i primi tornei delle sei categorie giovanili ai quali hanno partecipato ben 36 coppie (femminili e maschili). I giovani beacher hanno mostrato agli spettatori partite mozzafiato, piene di scambi palla entusiasmanti e tanta devozione. In testa a tutte e tre le categorie maschili si sono piazzati accoppiamenti dell’SSV Brunico, le categorie femminili invece sono state dominate dalle bolzanine. Gli organizzatori locali dell’AS Merano Volley e l’STS – Sport Team Südtirol di Bolzano possono essere fieri dell’evento e del successo che ha avuto. Ora l’interesse si sposta verso la prossima tappa del Raiffeisen Beachcup a Chiusa dove sabato 2 luglio si terrà la prima tappa AMATORIALE e domenica 3 luglio un’altra tappa GIOVANILE. Tutti i risultati: Tornei giovanile Tornei Open Beachcup News Get Ready! 13.06.2016 Data d\'iscrizione per Chiusa mostra articolo » Risultati Tirolo 07.06.2016 In testa noti altoatesini mo